INSERT INTO `star` (`star_id`, `star_type`, `star_name`, `slug`, `star_desc`, `status`) VALUES
(1, 'actor', '', '', ' ', 1),
(2, 'actor', 'Rosa Salazar (I)', 'rosa-salazar-i', 'Rosa Bianca Salazar is an American actress. She was born in Washington D.C. and raised in Greenbelt, Maryland. She is best known for her role in the NBC series Parenthood (2010) and the FX anthology series American Horror Story (2011). Her past films include Maze Runner: The Death Cure (2018) for Twentieth Century Fox, CHIPS (2017) for Warner Bros...', 1),
