(41, '', 'Game of Thrones', NULL, 'game-of-thrones', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 22px; color: rgb(181, 183, 184); font-family: &quot;source sans pro&quot;, sans-serif; background-color: rgb(38, 43, 54);\">Game of Thrones TV Series (2011– ) သည္ IMDb 9.5/10&nbsp;TV.com 9/10 Rotten Tomatoes 94% Google users 95% ဒါရုိက္တာ David Benioff, D.B. Weiss တုိ႕က ဖန္တီးေရးသား ရုိက္ကူးထား၍ သရုပ္ေဆာင္ Emilia Clarke, Peter Dinklage, Kit Harington တုိ႕ ပါဝင္သရုပ္ေဆာင္ထားေသာ Action, Adventure, Drama ဇာတ္လမ္းတြဲေကာင္း တစ္ခုျဖစ္တဲ့အတြက္ ခ်စ္ျခင္းအားျဖင့္ တင္ဆက္လုိက္ပါရေစ…၂၀၁၉ အထိ Season 8 ခု ထြက္ရွိထားျပီး ယခု Season 1 မွာ Episode ၁၀ ခု ပါဝင္မွာ ျဖစ္ပါတယ္…Season 1 မွာ Episoe 10 ခု ပါဝင္မွာ ျဖစ္ပါတယ္ျမင့္ျမတ္တဲ့ မိသားစု ကုိးစုဟာ ဝက္စ္ထရုိစ္ ရဲ့ ဒ႑ာရီနယ္ေျမမ်ားကုိ ထိန္းခ်ဳပ္ႏုိင္ဖုိ႕ တုိက္ခုိက္ေနခ်ိန္မွာပဲ လြန္ခဲ့ေသာ ႏွစ္ေထာင္ေပါင္းမ်ားစြာ ေရွးေဟာင္းရန္သူၾကီး ျပန္ေရာက္လာတဲ့အခါ ဘယ္လုိရင္ဆုိင္ တုိက္ခုိက္သြားမလဲ အက္ရွင္ စြန္႕စားခန္းမ်ားကုိ ဇာတ္လမ္းတြဲ တစ္တြဲခ်င္း တစ္ပုိင္း မပ်င္းရေအာင္ ရုိက္ကူသြားတာကုိ ခံစားၾကည့္ရႈ ၾကည့္ၾကစုိ႕လားဗ်ာ…</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 22px; color: rgb(181, 183, 184); font-family: &quot;source sans pro&quot;, sans-serif; background-color: rgb(38, 43, 54);\">Review Credit to FOF Myanmar</p>', '1603,1604,1293,1605,1606,1638,1608,1609,1610,1611,1639,1613,1614,1615,1616,1617', '1', '1640', '0', '2019-08-03', '85', '10,40,41', NULL, '', 'HD', 1, 0, 0, NULL, NULL, NULL, '8.1', 1, 1, 75, 75, 75, 76),
(44, '', 'The Angry Birds Movie', NULL, 'the-angry-birds-movie', '<p>ကမၻာေက်ာ္ဂိမ္းကို ရုပ္ရွင္အျဖစ္ ျပန္ၿပီး အသက္သြင္းတဲ့ The Angry Birds Movie ျဖစ္ပါတယ္ ..</p><p>Animation ပရိတ္သတ္တို႔ ေမၽွာ္လင့္ခဲ့ရတဲ့ ရုပ္ရွင္ကားဆိုလည္း မမွားပါဘူး ..</p><p>ဇာတ္လမ္းအရဆိုရင္ Angry Bird ေတြ ျဖစ္ေပၚလာပံုကို အစပ်ိဳး မိတ္ဆက္ေပးထားပါတယ္</p><p>ဂိမ္းထဲမွာ ဘာေၾကာင့္ ဝက္ေတြနဲ႔ ရန္ျဖစ္ရလဲ ဆိုတဲ့အေၾကာင္းကို သိရမွာပါ ..</p><p>ဂိမ္းထဲက အတိုင္း ငွက္တစ္ေကာင္စီရဲ႕ စြမ္းရည္တစ္မ်ိဳးစီကိုလည္း ေကာင္းေကာင္းမြန္မြန္ ၾကည့္ရႉခံစားရပါမယ္..</p><p>ဇာတ္လမ္းႀကီးႀကီးမားမားမရွိေပမယ့္ တင္ဆက္ျပသပံု မဆိုးတဲ့အတြက္ ၾကည့္ရႈမယ့္</p><p>ပရိတ္သတ္ေတြ သေဘာက် စိတ္ေက်နပ္ေစမွာပါ …</p><p>ရုပ္ရွင္ကေပးတဲ့ message ေတြကလည္း ေကာင္းမြန္တဲ့အတြက္ ၾကည့္ရက်ိဳးနပ္ပါလိမ့္မယ္ ..</p><p>အထူးသျဖင့္ ဇာတ္ေကာင္ေလးေတြကို မိတ္ဆက္တဲ့ေနရာမွာ သေဘာက်စရာေလးေတြပါဝင္ၿပီး</p><p>ခ်စ္စရာပံုစံေလးေတြလည္း အမ်ားႀကီးေတြ႕ရပါဦးမယ္ ခင္ဗ် ..</p><p>ေျပာရရင္ animation cartoon ခ်စ္သူတို႔ အႀကိဳက္ေတြ႕ေစမယ့္ ရုပ္ရွင္ကားတစ္ကားျဖစ္ပါေၾကာင္း။</p><p>အားေပးၾကည့္ရႈခံစားၾကပါဦး</p><p>(ေဩာ္ ေမ့ေတာ့မလို႔ စာတန္းထိုးၿပီးတဲ့အထိၾကည့္ၾကပါလို႔ )</p><p>review ကေတာ့ channelmyanmar မွကူးယူတင္ဆက္ထားတာျဖစ္ပါတယ္။</p>', '1667,1668,1669,1670,1671,1606,1672,44,1673,1674,1675,1676,1677,1678,1679,12,1680,1681,1682,1683,1684,1685,1686,1687,1688,1689,1690,1691,1692,1693,1723,1695,1696,1697,1698,1699,1700,1701', '1693,1695', '1705,1703,1724,1691', '0', '2016-05-20', '68', '4,5,7', NULL, '97 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6', 0, 1, 15, 15, 15, 16),
(45, 'tt0989757', 'Dear John', NULL, 'dear-john', '<p class=\"separator\" data-blogger-escaped-style=\"clear: both; text-align: center;\"><span style=\"font-family: \'helvetica neue\', \'segoe ui\', helvetica, arial, sans-serif; font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white; font-family: &quot;helvetica neue&quot; , &quot;segoe ui&quot; , &quot;helvetica&quot; , &quot;arial&quot; , sans-serif; font-size: 16px; text-align: left; white-space: pre-wrap;\">ပထမဦးဆုံးေျပာခ်င္တာက</span></p><p class=\"separator\" data-blogger-escaped-style=\"clear: both; text-align: center;\"><span style=\"font-family: \'helvetica neue\', \'segoe ui\', helvetica, arial, sans-serif; font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white; font-family: &quot;helvetica neue&quot; , &quot;segoe ui&quot; , &quot;helvetica&quot; , &quot;arial&quot; , sans-serif; font-size: 16px; text-align: left; white-space: pre-wrap;\">IMDB - 6.3 ရထားတဲ့ဒရမ္မာကားေကာင္းေလးတစ္ကားျဖစ္ပါတယ္</span></p><p class=\"separator\" data-blogger-escaped-style=\"clear: both; text-align: center;\"><span style=\"font-family: \'helvetica neue\', \'segoe ui\', helvetica, arial, sans-serif; font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white; font-family: &quot;helvetica neue&quot; , &quot;segoe ui&quot; , &quot;helvetica&quot; , &quot;arial&quot; , sans-serif; font-size: 16px; text-align: left; white-space: pre-wrap;\">ဒီကားေလးက ထြက္တာၾကာေနပါျပီ ဒါေပမယ့္ Old but Gold ဆိုတဲ့အတုိင္း အေဟာင္းထဲက အေကာင္းေလးလို႕ေျပာပါရေစ ကြ်န္ေတာ္အၾကိဳက္ Romance ကားထဲက တစ္ကားပါ John လို႕ေခၚတဲ့ေကာင္ေလးက သူအလုပ္ကေနခြင့္ရလို႕ သူ႕ဇာတိကုိ ျပန္လာတဲ့အခ်ိန္မွာ သကၠသုိလ္ေက်ာင္းသူေလးတစ္ေယာက္နဲ႕ေတြ႕ျပီး ေနာက္ပိုင္းၾကာလာေတာ့ တစ္ေယာက္နဲ႕ တစ္ေယာက္စာေလးေတြေရးပို႕ျပီးေတာ့ သံေယာဇဥ္တစ္ခုကို တည္ေဆာက္ၾကတယ္.... ဆရာ တကၠသုိလ္ဘုန္းႏုိင္ ေရးထားတဲ့ စာေလးမွာ \"ေလာကမွာ ျဖစ္ႏိုင္တာရွိတယ္ မျဖစ္ႏုိင္တာရွိတယ္ ျဖစ္ခ်င္တာရွိတယ္ မျဖစ္ခ်င္တာရွိတယ္.. ျဖစ္သင့္တာရွိတယ္ မျဖစ္သင့္တာရွိတယ္.. မျဖစ္ႏိုင္တာေတြကို ေလွ်ာက္မလုပ္ထိုက္သလို ကိုယ္ျဖစ္ခ်င္တာေတြခ်ည္းပဲ ေလွ်ာက္လုပ္ေနလို႕မေကာင္းဘူး\" ဆိုတဲ့အပိုင္းေလးကို သတိရမိတယ္.. သူတို႕ရဲ႕ခ်စ္ျခင္းေတြ သံေယာဇဥ္ေတြက ေနာက္ဆုံးတုိင္အထိ တည္ျမဲသြားမလား ၾကံကမၼာအလွည့္အေျပာင္းမွာ ဘာေတြဆက္ျဖစ္သြားမလဲဆိုတာကိုေတာ့......</span></p><p class=\"separator\" data-blogger-escaped-style=\"clear: both; text-align: center;\"><span style=\"font-family: \'helvetica neue\', \'segoe ui\', helvetica, arial, sans-serif; font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white; font-family: &quot;helvetica neue&quot; , &quot;segoe ui&quot; , &quot;helvetica&quot; , &quot;arial&quot; , sans-serif; font-size: 16px; text-align: left; white-space: pre-wrap;\">အညႊန္းနဲ႔ဘာသာျပန္သူကေတာ့ Sai Wunna ဘဲျဖစ္ပါတယ္</span></p>', '1725,1726,1727,1728,1729,1730,1731,1732,1758', '1759', '1735,1740', '0', '2019-08-12', '68', '10,19,39', NULL, '115 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.8', 0, 1, 4, 4, 4, 5),
(46, 'tt2334879', 'White House Down', NULL, 'white-house-down', '<div class=\"separator\"><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">2013 ခုႏွစ္ကထြက္ရွိထားတဲ့ အိမ္ျဖဴေတာ္က်ဆံုးခန္းအေၾကာင္းကိုရိုက္ထားတဲ့ဇတ္ကားေလးျဖစ္ပါတယ္။</span></div><p><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">သမၼတအိမ္ေတာ္ကိုျပန္ေပးဆြဲတဲ့ Action ဇတ္ကားေကာင္းေလးတစ္ကားျဖစ္ပါတယ္။</span><br><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">IMDB Rating 6.4 ရရွိထားတဲ့ရုပ္ရွင္ဇတ္ကားေကာင္းေလးတစ္ကားျဖစ္ပါတယ္။</span><br><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">Olympus Has Fallen လိုမ်ိဳးသမၼတကိုျပန္ေပးဆြဲတာျခင္းဇတ္လမ္းဆင္တူေပမယ့္</span><br><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">ဒီဇတ္ကားထဲမွာ သမၼတကနည္းနည္းလန္းေနတာကိုေတြ႕ရမွာျဖစ္ပါတယ္။ :P</span><br><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">သမၼတသက္ေတာ္ေစာင့္အျဖစ္သြားေရာက္ေလွ်ာက္ထားရာမွာျငင္းပယ္ခံခဲ့ရပါတယ္။</span><br><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">ဒါ့ေၾကာင့္သူ႕သမီးေလးႏွင့္အိမ္ျဖဴေတာ္ထဲမွာအလည္အပတ္သြားေရာက္ေနစဥ္မွာ</span><br><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">မသမာသူတစ္ခ်ိဳ႕ကအိမ္ျဖဴေတာ္ကိုဝင္ေရာက္စီးနင္းတိုက္ခိုက္ၿပီးေတာ့...</span></p><div class=\"separator\"><span style=\"font-size: 14pt; font-family: arial, helvetica, sans-serif;\">ဇတ္လမ္းေလးကိုဆက္လက္ၾကည္႕ရႈရင္းခံစားေပးပါခင္ဗ်ာ ;)</span></div>', '1726,1760,1761,1762,1728,1763,1764,1765,1766,1767,1768,1769,1770,1771,1772,1773,1774,1775,1776,1777,1778,1779', '1780', '1784', '0', '2019-08-12', '68', '1,10,18', NULL, '131 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.4', 0, 1, 13, 13, 13, 14),
(47, 'tt1611224', 'Abraham Lincoln: Vampire Hunter', NULL, 'abraham-lincoln-vampire-hunter', '<p class=\"separator\" data-blogger-escaped-style=\"clear: both; text-align: center;\"><span style=\"font-family: \'source sans pro\', sans-serif; font-size: 14pt;\" data-blogger-escaped-style=\"background-color: white; font-family: &quot;source sans pro&quot; , sans-serif; font-size: 15px;\">အေမရိကကို ျပင္ပကေန ဘယ္ေတာ့မွ ဖ်က္ဆီးႏိုင္မွာ မဟုတ္ဘူး။က် ဳပ္တို ့အင္အားခ်ိနဲ ့ၿပီး လြတ္လပ္မွဳေတြ ဆံုးရွံဴ း<br>ရၿပီဆိုရင္ ဒါဟာက် ဳပ္တို ့ကိုယ္တိုင္ ဖ်က္ဆီးပစ္တာေၾကာင့္ပဲ ျဖစ္လိမ့္မယ္။(ေအဘရာဟမ္လင္ကြန္း)</span></p><div data-blogger-escaped-style=\"border: 0px; float: left; font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px; line-height: 22px; margin-bottom: 10px; padding: 0px; vertical-align: baseline; width: 658px;\"><p><span style=\"font-size: 14pt;\" data-blogger-escaped-style=\"background-color: white;\">သမၼတလင္ကြန္း ဆိုခဲ့သလို စစ္ေရး၊ စီးပြားေရး မဟာအင္အားႀကီးစူပါပါဝါအေမရိကကို ျပင္ပကမာၻက ဖ်က္ဆီးႏိုင္ဖို ့၊ ရန္သတၱရုျပဳဖို ့ဆိုတာ မလြယ္လွသလို၊ ဆိုးရြားျပင္းထန္တဲ့ အက် ဳိးဆက္ေတြနဲ ့ၾကံဳေတြ ့ရမွာ ေျမႀကီးလက္ခတ္မလြဲပါပဲ။ ‘ေသြးထြက္သံယိုမွဳမရွိဘဲႏိုင္ငံတစ္ခုကို မတည္ေဆာက္ႏိုင္’ ဆိုတဲ့အတိုင္း လင္ကြန္းကိုယ္တိုင္ထိတ္လန္ ့ေျခာက္ျခားဖြယ္ရာ ေသြးသံရဲရဲ အနိဌာရုံေတြ၊ တိုက္ခိုက္သတ္ျဖတ္မွဳေတြကို ေရွာင္လႊဲမရစြာ လုပ္ေဆာင္ခဲ့ရတာလည္း ရွိေလရဲ့။လင္ကြန္းရဲ့ ေက်ာ္ၾကားလွတဲ့ အထက္ပါစကားရပ္လို အေမရိကကိုအၿပီးတိုင္ ဖ်က္ဆီးပစ္မယ့္ ရန္သူဟာ ႏိုင္ငံအတြင္းမွာ တကယ္ကိုရွိေနခဲ့ပါၿပီ။ ေအဘရာဟမ္လင္ကြန္း လို ့ဆိုလိုက္တာနဲ ့အေမရိကရဲ့၁၆ ေယာက္ေျမာက္သမၼတ၊ ေငြဝယ္ကြ်န္စနစ္ ပေပ်ာက္ေရး ႀကိဳးပမ္းသူစတဲ့ သမိုင္းအခ်က္အလက္ေတြကိုသာ သတိရၾကစၿမဲပါ။ လင္ကြန္းနဲ ့ပတ္သက္ၿပီး အလြန္အေရးႀကီးလွသည့္တိုင္ သမိုင္းမတြင္တဲ့ အေၾကာင္းျခင္းရာတစ္ခုကေတာ့ အင္မတန္ လူသိနည္းလွပါတယ္။ အဲဒါကေတာ့လင္ကြန္းဟာ ေန ့ဘက္မွာ တိုင္းျပည္ကို သမၼတအျဖစ္ စီမံအုပ္ခ် ဳပ္ၿပီး၊အကာလ ညအခါမွာ ေသြးစုပ္ဖုတ္ေကာင္ေတြကို လိုက္လံသုတ္သင္ေခ်မွဳန္းသူတစ္ဦး ဆိုတာပါပဲ။ ဒီသမိုင္းျဖစ္ရပ္ေတြကို ဆက္သ္ဂေရဟမ္စမစ္သ္ က ေလ့လာေဖာ္ထုတ္ ဇာတ္ညႊန္းခြဲၿပီး၊ ဒါရုိက္တာ ဘက္ခ္မမ္ဘီေတာ့ဗ္ က ရုိက္ကူးတင္ျပလိုက္တဲ့အခါ -Abraham Lincoln: Vampire Hunter ဆိုၿပီး ျဖစ္လာပါတယ္။</span></p></div><div data-blogger-escaped-style=\"border: 0px; float: left; font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px; line-height: 22px; margin-bottom: 10px; padding: 0px; vertical-align: baseline; width: 658px;\"><p><span style=\"font-size: 14pt;\" data-blogger-escaped-style=\"background-color: white;\">ေခါင္းေဆာင္မင္းသား ဘင္ဂ်မင္ေဝၚကာရဲ့အထူးပီျပင္လွတဲ့ အင္ျပည့္အားျပည့္ သရုပ္ေဆာင္ခ်က္ေတြ၊ေသြးပ်က္ေျခာက္ျခားစရာ တိုက္ခိုက္ခန္းေတြ၊ အန္ေထာ္နီမက္ကီ၊ေဒါမနစ္ကူးပါး စတဲ့ ဇာတ္ပို ့ေကာင္းေတြ၊ မင္းသမီးေခ်ာ မယ္ရီအဲလီဇဘက္သ္ဝင္းစတက္ဒ္ ရဲ့ အားျဖည့္မွဳေတြနဲ ့ဇာတ္ကားေကာင္းတစ္ကားလို ့ဆိုႏိုင္ပါတယ္။ ၂၀၁၂ က ထြက္တဲ့ ဒီဇာတ္ကားကို ထိတ္လန္ ့သဲဖိုအက္ခ္ရွင္ကားအျဖစ္သာ ၾကည့္ဖို ့ေတာ့ အႀကံျပဳခ်င္ပါတယ္။ စတီဗင္စပီးလ္ဘာ့ဂ္ ရုိက္ကူးၿပီး၊ ဒန္နီယယ္လ္ေဒးလူးဝစၥ ေအာ္စကာဆုရခဲ့တဲ့Lincoln နဲ ့ႏွဳိင္းယွဥ္မၾကည့္ဘဲ၊ ေပါ့ေပါ့ပါးပါး action&amp;horror ကားအျဖစ္ ၾကည့္မယ္ဆိုရင္ Abraham Lincoln: Vampire Hunter ဟာၾကည့္ေပ်ာ္ရုံအဆင့္ထက္ မ်ားစြာသာလြန္ေၾကာင္းပါ။</span></p></div><div data-blogger-escaped-style=\"border: 0px; float: left; font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px; line-height: 22px; margin-bottom: 10px; padding: 0px; vertical-align: baseline; width: 658px;\"><p><span style=\"font-size: 14pt;\" data-blogger-escaped-style=\"background-color: white;\">(ဇာတ္ကားအညြန္းကိုေတာ့ www.trend.com.mmမွ ကူးယူေဖာ္ျပထားတာပါ)</span></p></div>', '1926,1927,410,1928,1929,1930,1931,1932,1765,1933,1978,1935,1936,1937,1979,1939,1940,1941,1942,1943,1944,1945,1980,1947,1948,1949,1950,1951,1952,1953,1954,1955,1956,1957,1958,1959', '1970', '1981,1964,1981', '0', '2019-08-12', '68', '1,12,14', NULL, '94 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '5.6', 0, 1, 8, 8, 8, 9),
(48, 'tt2368672', 'Minuscule: Valley of the Lost Ants', NULL, 'minuscule-valley-of-the-lost-ants', '<p>ပုရြက္ဆိတ္ animation ဇာတ္ကားေလးတစ္ကားျဖစ္ပါတယ္။</p><p>IMDB Ration - 7.1/10 ရရွိထားတဲ့ဇာတ္ကားေကာင္းေလးဘဲျဖစ္ပါတယ္။</p><p>ဇာတ္လမ္းရဲ႕အစမွာေတာ့ လင္မယား၂ေယာက္ဟာေပ်ာ္ပြဲစားထြက္လာရင္း</p><p>မိန္းမျဖစ္သူကမီးဖြားခါနီးျဖစ္လို႔အသဲအသန္ျပန္ရာကေနစပါတယ္။</p><p>ထိုစဥ္မွာေခ်းပိုးထိုးအေကာင္ေလးကလည္းေမြးဖြားလာပါတယ္။</p><p>အဲဒီေနာက္မွာေပ်ာ္ပြဲစားထြက္တဲ့အစားအစာအခ်ိဳ႕က်န္ရွိေနပါေတာ့တယ္။</p><p>ဒီအစားအစာေတြကိုသတၱဝါေပါင္းစံုအေကာင္ေပါင္းစံုကေနၿပီးလာေယာက္</p><p>စားသံုးၾကပါေတာ့တယ္။အဲဒီအထဲကမွပုရြက္ဆိတ္အနက္ေတြလည္းပါပါတယ္။</p><p>ပုရြက္ဆိတ္အနက္ေတြက သံဘူးထဲမွသၾကားခဲေတြကိုေရႊေတြ႕ေငြေတြ႕ေတြ႕ၿပီး</p><p>အျပန္မွာ ....ဘာာေတြဆက္ျဖစ္မလဲဆိုတာကိုေတာ့ဇာတ္လမ္းေလးထဲမွာဘဲဆက္လက္ရႈစားေပးပါ။</p><p>အညႊန္းကိုေတာ့ Burmese Subtitle Team မွျပန္ဆုိထားတာျဖစ္ပါတယ္။</p><p>Animation ကားေကာင္းေလးတစ္ကားျဖစ္လို႔ မိသားစုနဲ႔အတူမွ်ေဝခံစားၾကည္႕ရႈႏိုင္ပါတယ္။</p>', '2122,2123', '2124,1985', '1985,2124', '0', '2019-08-12', '11,53', '4,5,11', NULL, '89 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.8', 0, 1, 7, 7, 7, 8),
(49, 'tt2872732', 'Lucy', NULL, 'lucy', '<p><span style=\"font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">လူစီဟာ ထုိင္ဝမ္ႏုိင္ငံ တုိင္ေပၿမိဳ႕မွာ ေက်ာင္းတက္ေနတဲ့ ေက်ာင္းသူတစ္ေယာက္ပါ။ သူ႔ရဲ႕ ရည္းစားက သူ႔ကို လိမ္ေခၚလာတာေၾကာင့္ ကိုရီးယားက လူဆုိးအဖြဲ႕တစ္ဖြဲ႕ဆီမွာ အဖမ္းခံရပါတယ္။ သူ႔ရည္းစားလည္း အသတ္ခံရၿပီး သူကေတာ့ CPH4 လုိ႔ေခၚတဲ့ စိတ္ႂကြေဆးတစ္မ်ဳိးကို သယ္ေဆာင္ေပးဖို႔ အၾကပ္ကိုင္ခံရပါတယ္။ ဘယ္လို သယ္ေဆာင္ေပးရမလဲဆိုေတာ့ သူ႔ဗုိက္ကိုခြဲ၊ CPH4 အိတ္ကို ဗိုက္ထဲ ထည့္ေပးလုိက္ပါတယ္။ သူလိုမ်ဳိး ထည့္ေပးခံလုိက္ရသူ ၄ ဦးရွိၿပီး မတူညီတဲ့ ေနရာေတြဆီ ပို႔ေပးရမွာပါ။ ဒါေပမယ့္ သူ႔ကို ေစာင့္ေပးရတဲ့ လူဆိုးတစ္ေယာက္နဲ႔ ျပႆနာတက္ၿပီး ဗိုက္ကို အကန္ခံရတာေၾကာင့္ CPH4 အိတ္ေပါက္သြားၿပီး ခႏၶာကိုယ္ထဲကို CPH4 ေတြ တုိက္႐ိုက္ဝင္ကုန္ပါတယ္။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">ပေရာ္ဖက္ဆာ ဆမ္ျမဴရယ္ ေနာ္မန္ဟာ သက္ရွိေတြရဲ႕ ဦးေႏွာက္နဲ႔ အာ႐ံုေၾကာေတြ တိုးတက္ေျပာင္းလဲလာမႈကို သုေတသနျပဳ စာတမ္းေရးသားေနသူျဖစ္ၿပီး သူ႔ရဲ႕ သီအိုရီအရ လူသားေတြဟာ သူတို႔ဦးေႏွာက္ရဲ႕ ၁၀%ကိုသာ အသံုးျပဳေနေၾကာင္း ထုတ္ေဖာ္ေျပာဆိုခဲ့ပါတယ္။ ၂၀%ကို အသံုးျပဳႏုိင္သူေတြဟာ လင္းပိုင္ေတြျဖစ္ၿပီး ဆိုနာလႈိင္းေတြကို အသံုးျပဳရင္း တစ္ေကာင္နဲ႔တစ္ေကာင္ ဆက္သြယ္ၾကေၾကာင္းလည္း ရွင္းျပခဲ့ပါတယ္။ ေမးခြန္းက ဒီ့ထက္ပို အသံုးျပဳခဲ့ရင္၊ အဆံုးစြန္ဆံုး ၁၀၀% အသံုးျပဳခဲ့ရင္ ဘာျဖစ္မလဲ ဆုိတာပါပဲ။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">လူစီရဲ႕ ခႏၶာကိုယ္ထဲက CPH4 ေတြဟာ ဦးေႏွာက္နဲ႔ အာ႐ံုေၾကာေတြကို အလြန္အၾကဴး လံႈ႕ေဆာ္လာတဲ့အခါမွာ သာမန္ထက္ပိုထက္ စြမ္းအားေတြ ရလာခဲ့ပါတယ္။ သူ႔ကို ဖမ္းဆီးထားတဲ့ လူေတြလက္ထဲကေန ထြက္ေျပးၿပီးေနာက္ ေဆး႐ံုကိုသြားၿပီး ဗုိက္ထဲက အိတ္ကို ျပန္လည္ထုတ္ယူလုိက္ပါတယ္။ ေနာက္မွာေတာ့ Lucy ဟာ သူ႔ရဲ႕ အေျခအေနကို ရိပ္စားမိသြားၿပီး အကယ္၍ ေဆးထုပ္ေတြ အကုန္လံုးသား မရခဲ့ရင္ ဆဲလ္ကြဲပြားမႈေၾကာင့္ သူေသသြားႏုိင္ေၾကာင္း သိသြားပါတယ္။ ဒါေၾကာင့္ ကိုရီယားလူဆိုးဂိုဏ္းေခါင္းေဆာင္ ရွိတဲ့ ဟိုတယ္ကိုသြားၿပီး ေဆးထုပ္ေတြကို ဘယ္လမ္းေၾကာင္းကေန ျဖန္႔သလဲဆိုတာ စံုစမ္းပါတယ္။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">ေဆးထုပ္ေတြ ဘယ္ေရာက္သြားလဲဆိုတာ သိသြားၿပီးေနာက္မွာေတာ့ လူစီဟာ ပေရာ္ဖက္ဆာ ေနာ္မန္ဆီ ဆက္သြယ္ပါေတာ့တယ္။ သူမတူတဲ့ စြမ္းအားေတြကို အစမ္းသေဘာျပၿပီးေနာက္မွာေတာ့ ပေရာ္ဖက္ဆာက သူနဲ႔ေတြ႕ဖို႔ သေဘာတူလိုက္ပါတယ္။ အဲဒီေနာက္မွာေတာ့ လူစီဟာ ထိုင္ဝမ္ကေန ျပင္သစ္ကို ခရီးဆက္ပါတယ္။ ျပင္သစ္က ရဲတစ္ေယာက္ျဖစ္တဲ့ Pierre Del Rio ဟာ CPH4 နဲ႔ ပတ္သက္တဲ့ သတင္းကို လူစီထံကေန လက္ခံရရွိပါတယ္။ ထူးျခားတဲ့ လူစီရဲ႕ ေျပာၾကားခ်က္ေတြေၾကာင့္ Del Rio ဟာ လူစီေျပာတဲ့အတုိင္း လူဆိုးေတြကို ဖမ္းဆီးႏုိင္လုိက္ပါတယ္။ ဒါေပမယ့္ ေလယာဥ္ေပၚမွာ လူစီဟာ ဆဲလ္ကြဲပြားမႈ အလြန္အက်ဴး ျဖစ္လာၿပီး သတိလစ္သြားတာေၾကာင့္ Del Rio က လာဖမ္းပါတယ္။ ဒါေပမယ့္ လာဖမ္းတဲ့ရဲေတြကို လူစီက အလြယ္တကူပဲ ႏွိမ္နင္းလိုက္ၿပီး သူ႔ကို ကူညီဖုိ႔ Del Rio ကို ေျပာပါတယ္။ မျငင္းႏုိင္တဲ့ Del Rio ဟာ လူစီေခၚေဆာင္ရာ ပါသြားပါတယ္။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">လူစီနဲ႔ ကိုရီးယား ဂိုဏ္းတို႔ ဘယ္လို အားၿပိဳင္ၾကမလဲ။ ပေရာ္ဖက္ဆာကေရာ သူ႔ကို ဘယ္လို ကူညီမလဲဆိုတာကိုေတာ့ ဆက္လက္႐ႈစားၾကပါကုန္။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">နာမည္ေက်ာ္ ညႇိဳ႕အားျပင္း မင္းသမီးေခ်ာ Scarlett Johansson ေခါင္းေဆာင္ပါဝင္ၿပီး ကိုရီးယား မင္းသားႀကီး Choi Min Sik က Johansson နဲ႔ အၿပိဳင္ လူဆိုးႀကီးအျဖစ္ သ႐ုပ္ေဆာင္ထားပါတယ္။ ပေရာ္ဖက္ဆာ ေနာ္မန္အျဖစ္ Morgan Freeman က Logic ေတြ ေတာ္ကီပြား႐ံု သ႐ုပ္ေဆာင္ထားၿပီး Amr Waked က Del Rio အျဖစ္ သ႐ုပ္ေဆာင္ထားပါတယ္။ The Fifth Element နဲ႔ The Lady ဇာတ္ကားေတြကို ႐ိုက္ကူးခဲ့တဲ့ ျပင္သစ္ဒါ႐ိုက္တာ Luc Besson က ႐ိုက္ကူးထားၿပီး ကုန္က်စရိတ္ ေဒၚလာ သန္း ၄၀ပဲ ရွိခဲ့ေပမယ့္ ဝင္ေငြ သန္း ၁၀၀ ေက်ာ္ ျပန္လည္ရရွိခဲ့တဲ့ ဇာတ္ကားျဖစ္ပါတယ္။ IMDb မွာ Rating 6.6 ရရွိထားၿပီး Rotten Tomatoes မွာလည္း Tomatometer 62% ရရွိထားတဲ့ ဇာတ္ကားတစ္ကား ျဖစ္ပါတယ္။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">ဇာတ္လမ္းရဲ႕ ေက်ာ႐ိုးယူဆခ်က္ ေကာင္းမြန္သေလာက္ အဲဒီယူဆခ်က္ကို မွီေအာင္ ဇာတ္အိမ္ကုိ ဇြတ္အတင္းဆြဲသြင္း တည္ေဆာက္ထားရတဲ့ ဇာတ္ကားလို႔ပဲ ေဝဖန္ခ်င္ပါတယ္။ ႐ုပ္ထြက္ အထူးျပဳလုပ္ခ်က္မ်ားစြာနဲ႔ စြဲေဆာင္မႈရွိေအာင္ ဖန္တီးထားသလို မင္းသမီး Scarlett Johansson ရဲ႕ ညႇဳိ႕ငင္ႏုိင္စြမ္းအားကို အဓိကအသံုးခ်ၿပီး ဇာတ္ကို သယ္ေဆာင္သြားေပမယ့္ ဇာတ္လမ္းအဆံုးသတ္ကေတာ့ အေတာ္ကို စိတ္ပ်က္ဖို႔ ေကာင္းပါတယ္။ Logic ေတြကို အရမ္းဦးစားေပးၿပီး တကယ့္ဇာတ္အိမ္သယ္ရမယ့္ အခန္းေတြမွာ ျဖစ္သလို ဇာတ္ကြက္ေတြ ထည့္သြင္းထားတာကလည္း စိတ္ပ်က္စရာပါ။ ရန္သူကို လြယ္လြယ္ကူကူ ရင္ဆုိင္ႏိုင္ေပမယ့္လည္း စြတ္ရြတ္အစြမ္းေတြ ထုတ္ျပေနၿပီး တကယ္တမ္းက်ေတာ့ လွည့္ကြက္ေတြ သိပ္မပါပဲ ေနာက္ဆံုးခန္းက်မွ သူျပခ်င္တဲ့ Logic ကို ထုတ္ျပရင္း မ်က္လွည့္ျပထားပါတယ္။ ဒီဇာတ္ကားထဲက Logic နဲ႔ ပတ္သက္လို႔ကေတာ့ ေဟာလိဝုဒ္မွာ အေတာ္ေလး ႐ိုက္ခတ္သြားၿပီး ျငင္းခုန္ေနၾကဆဲ ျဖစ္ပါတယ္။ ဇာတ္လမ္းထဲက ႐ိုက္ခ်က္ေတြနဲ႔ မင္းသမီးရဲ႕ သ႐ုပ္ေဆာင္ခ်က္ေတြကေတာ့ ထိပ္တန္းအဆင့္ ရွိပါတယ္။ ေခါင္းစားခံႏိုင္မယ့္သူမ်ဳိးသာ ၾကည့္သင့္တဲ့ ဇာတ္ကားမ်ဳိးပါပဲ။ ေသြးေအးေအးနဲ႔ ပစ္သတ္တဲ့ အခန္းေတြ၊ ေသြးထြက္သံယို အခန္းေတြေၾကာင့္ Rating R အဆင့္ သတ္မွတ္ထားတာေၾကာင့္ ကေလးေတြ ၾကည့္ဖို႔ မသင့္ေတာ္ပါဘူး။</span><br data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\"><span style=\"font-family: \'source sans pro\' , sans-serif;\" data-blogger-escaped-style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 15px;\">(ရုပ္ရွင္အညႊန္းကို Movie Guide မွကူးယူေဖာ္ျပသည္)</span></span><br></p>', '398,2125,2254,2127,2255,2256,2130,2257,2258,2133,2259,2135,2136,2137,2138,2139,2260,2141,2261,2143,2262,2145,2263,2147,2264,2149,2150,2151,2152,2153,2154,2155,2156,2157,2158,2159,2160,2265,2266,2267,2164,2268,2269,2167,2168,2169,2170,2270,2271,2173,2', '2183', '2183', '0', '2019-08-12', '11', '1,42', NULL, '89 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.3', 0, 1, 15, 15, 15, 16),
(50, 'tt2713180', 'Fury', NULL, 'fury', '<p><span style=\"font-size: 12pt;\">၁၉၄၅ ခုုႏွစ္၊ ဧျပီလ။&nbsp; ဒုုတိယကမၻာစစ္ ဥေရာပစစ္ေျမျပင္။&nbsp; အင္အားၾကီးစစ္ႏိုုင္ငံျဖစ္တဲ့&nbsp; နာဇီ ဂ်ာမနီႏိုုင္ငံအား အေမရိကန္မွ ေနာက္ဆံုုးထိုုးစစ္ဆင္ တိုုက္ခိုုက္ေနတဲ့အခ်ိန္။</span></p><p><span style=\"font-size: 12pt;\">အေမရိကန္စစ္တပ္ တပ္မဟာ ၆၆၊ တပ္ခြဲ ၂မွ တပ္ၾကပ္ၾကီး ေကာ္လီရာ ( Collier ) က ယင္းစစ္ေျမျပင္မွာ ဖ်ဴရီ (fury)&nbsp; လိုု႔ေခၚတဲ့ တင့္ကား ကိုုဦးေဆာင္ကာ တိုုက္ပြဲ၀င္ေနသူျဖစ္ပါတယ္။ ဖ်ဴရီ ရဲ႔ တျခားတပ္ဖြဲ႔၀င္ေတြျဖစ္တဲ့&nbsp; ေသနတ္သမား ဘိုုင္ဘယ္ (Bible) ၊ လက္နက္ၾကီးက်ည္ျဖည့္တာ၀န္ ကြန္းအက္စ္ (Coon-Ass) ၊ တင့္ကားေမာင္းသူ ေဂၚဒိုု (Gordo) တိုု႔ဟာ စစ္စကတည္းက တြဲဖက္ညီညီ နဲ႔တိုုက္ပြဲ၀င္ခဲ့ၾကတဲ့ ၀ါရင့္စစ္သားေတြပဲျဖစ္ပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">ဖ်ဴရီ ရဲ႔လက္ေထာက္ကားေမာင္းသမား က်ဆံုုးသြားတဲ့အခ်ိန္မွာေတာ့ လူစားထိုုးအေနနဲ႔&nbsp; တပ္လက္ႏွိပ္စက္စာေရး ေနာ္မန္ ( Norman ) ေရာက္လာပါတယ္။ ဖ်ဴရီ ရဲ႔ အဖြဲ႔သားေတြက အေတြ႔အၾကံဳမရွိ တဲ့ ေနာ္မန္ကိုု မလိုုလားၾကပါဖူး။ တစ္ရက္ေတာ့ ကင္းေထာက္ထြက္ရင္း ဖ်ဴရီေပၚမွ ကင္းတာ၀န္ယူထားတဲ့ ေနာ္မန္က ရန္သူကိုုျမင္လိုုက္ေပမယ့္ ဆယ္ေက်ာ္သက္အရြယ္ျဖစ္ေနတာမိုု႔ သတ္ဖိုု႔လက္မရဲတဲ့အတြက္ အေမရိကန္တပ္မွ တင့္ကားတစ္စီးပ်က္စီးကာ စစ္သားမ်ားလည္း အႏိုုင္ရသြားပါတယ္။ ေကာ္လီရာက ေနာ္မန္ကိုု ေဒါသတၾကီးဆူပူကာ အရွင္မိထားတဲ့ ဂ်ာမန္သံုု႔ပန္းတစ္ေယာက္ကိုု သူ႔ေရွ႔မွာတင္ ေသနတ္နဲ႔ပစ္ခိုုင္းခဲ့ပါတယ္။ ေနာက္ဆံုုးမွာေတာ့&nbsp; ရန္သူကိုုမသတ္ရဲတဲ့ ေနာ္မန္ကိုု ေကာ္လီယာကိုုယ္တိုုင္ အတင္းဖမ္းခ်ဳပ္ျပီး လက္ထဲကိုုေသနတ္အတင္းထည့္ကာ ရန္သူကိုုပစ္သတ္လိုုက္ပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">ဖ်ဴရီအပါအ၀င္ တျခားတင့္ကားတပ္ဖြဲ႔ေတြက ရိကၡာပိုု႔ယဥ္ေတြကိုု ကာကြယ္ဖိုု႔ အေရးပါတဲ့လမ္းေၾကာင္း တစ္ေလ ွ်ာက္ စစ္ဆင္ေရးလုုပ္ခဲ့ရာ ဂ်ာမနီဘက္မွ အၾကီးစားတင့္ကား Tiger 1 နဲ႔ရင္ဆိုုင္ရတဲ့အတြက္ တျခားတင့္ကားေတြအားလံုုး ပ်က္ဆီးကာ ဖ်ဴရီတစ္စီးပဲ က်န္ရစ္ပါတယ္။ အျပန္လမ္းွာ ေျမျမႈပ္မိုုင္းတစ္ခုုကိုု နင္းမိျပီး ဖ်ဴရီရဲ႔ ဘီးေတြပ်က္ဆီးသြားပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">ေကာ္လီရာက ေနာ္မန္ကိုု အနားက ေတာင္ကုုန္းေပၚမွာ ကင္းေစာင့္ခိုုင္းထားျပီး က်န္တဲ့သူေတြနဲ႔ ဖ်ဴရီကိုု ျပင္ဖိုု႔ၾကိဳးစားပါတယ္။ ေနာ္မန္ကင္းေစာင့္ေနစဥ္အတြင္း ဂ်ာမန္စစ္သား သံုုးရာေက်ာ္ဟာ စစ္သီခ်င္းသံျပိဳင္ဆိုုကာ ဖ်ဴရီရွိတဲ့ လမ္းတည့္တည့္ကိုု ခ်ီတက္လာေနေၾကာင့္ ေတြ႔လိုုက္ရပါေတာ့တယ္။</span></p><p><span style=\"font-size: 12pt;\">အဲ့ဒီအေၾကာင္းကိုု ေနာ္မန္က ေကာ္လီရာဆီ အခ်ိန္မီေရာက္ေအာင္ အျမန္သတင္းပိုု႔လိုုက္ပါတယ္။ ေကာ္လီရာက ဖ်ဴရီတပ္ဖြဲ႔၀င္ေတြျဖစ္တဲ့ ဘိုုင္ဘယ္ ၊ ကြန္းအက္စ္&nbsp; ၊ေဂၚဒိုု&nbsp; နဲ႔ ေနာ္မန္တိုု႔ကိုု လက္နက္ က်ည္ဆံအျပည့္ေပးျပီး အကာအကြယ္ရွိရာ ေတာတန္းဆီကိုု ဆုုတ္ခြာခိုုင္းပါတယ္။ သူကိုုယ္တိုုင္ကေတာ့ ဖ်ဴရီေပၚမွ စက္ေသနတ္ကိုု က်ည္ျဖည့္ကာ ေစာင့္ေနခဲ့ပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">လက္တြဲညီတဲ့ ဖ်ဴရီ ဘက္ေတာ္သားေတြက ေခါင္းေဆာင္ျဖစ္တဲ့ ေကာ္လီရာကိုုမထားခဲ့ ႏိုုင္ၾကပဲ ဘီးေတြပ်က္ဆီးသြားလိုု႔ မေရြ႔လ်ားႏိုုင္ေတာ့တဲ့ ဖ်ဴရီေပၚမွေနျပီး ရန္သူအင္အား သံုုးရာေက်ာ္ကိုု ခုုခံဖိုု႔ ဆံုုးျဖတ္လိုုက္ၾကပါေတာ့တယ္။</span></p><p><span style=\"font-size: 12pt;\">သူတိုု႔ ၅ေယာက္က လက္နက္၊ က်ည္၊ လက္ပစ္ဗံုုး ရသမ ွ်စုုစည္းကာ ဖ်ဴရီကိုုလည္း တင့္ကားအပ်က္သဖြယ္ ျပင္ဆင္ျပီး ရန္သူတပ္ၾကီးအလာကိုု တင့္ကားအတြင္းမွ တိတ္ဆိတ္စြာေစာင့္ဆိုုင္းေနပါေတာ့တယ္။</span></p><p><span style=\"font-size: 12pt;\">တင့္ကားကိုု သန္႔ရွင္းေရးလုုပ္ဖိုု႔အသြား ကားအတြင္းမွ ခႏၥာကိုုယ္အပိုုင္းအျပတ္ကိုု ျမင္ျပီး ေၾကာက္လန္႔ကာထြက္ေျပးခဲ့ရတဲ့ ေနာ္မန္က အခုုေတာ့ ဖ်ဴရီရဲ႔ အားကိုုးရတဲ့ စစ္သားတစ္ေယာက္ျဖစ္ေနပါျပီ။ ေခါင္းေဆာင္ျဖစ္တဲ့ ေကာ္လီရာက ဖ်ဴရီကိုုေရာက္လာတဲ့ သူ႔လက္ေအာက္ငယ္သားအားလံုုးကိုု ေဘးကင္းေစရမယ္လိုု႔ အာမခံကာ သူကိုုယ္တိုုင္က တင့္ကားအတြင္းမွာဘယ္ေတာ့မွမေနပဲ တင့္ကားအမိုုးမွာေခါင္းထြက္ကာ တိုုက္ပြဲျမင္ကြင္းကိုု ေသခ်ာၾကည့္ျပီး ၾကီးၾကပ္ကြပ္ကဲတဲ့အတြက္ ရန္သူ႔တပ္နဲ႔ေတြ႔တိုုင္း ဖ်ဴရီက အႏိုုင္ရခဲ့တာခ်ည္းပဲျဖစ္ပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">ဒီတစ္ခါ တိုုက္ပြဲကေတာ့ ဖ်ဴရီအတြက္ ေနာက္ဆံုုးတုုိက္ပြဲျဖစ္မလား ။ ရန္သူဘက္မွအင္အားမ်ားေပမယ့္ တင့္ကားမပါတဲ့အတြက္ ဖ်ဴရီအတြက္ ေမ ွ်ာ္လင့္ခ်က္ရွိႏိုုင္မလား။ ေကာ္လီရာရဲ႔ ကြပ္ကဲမႈနဲ႔ဖ်ဴရီတပ္ဖြဲ႔၀င္ေတြ အရင္လိုုပဲ ေအာင္ပြဲခံႏိုုင္မလား ဆိုုတာကိုုေတာ့ ပိတ္ကားထက္မွာ ဆက္လက္ရႈစားၾကည့္ေစလိုုပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">ဖ်ဴရီက စစ္ပြဲ ရိုုက္ကြင္းအျပင္အဆင္၊ သရုုပ္ေဆာင္ေတြရဲ႔ ပီျပင္မႈ ေတြေၾကာင့္ ေ၀ဖန္ေရးဆရာေတြရဲ႔ ခ်ီးက်ဴးမႈကိုု ခံရတဲ့ စစ္ကားေကာင္းတစ္ကားျဖစ္ပါတယ္။ အထူးသျဖင့္ ေခါင္းေဆာင္မင္းသား ဘရက္ပစ္ရဲ႔ ေကာ္လီရာဇတ္ရုုပ္အေပၚ ပီျပင္မႈကလည္း ဇာတ္ရွိန္ကိုု ျမင့္တက္ေစပါတယ္။ ပါ၀င္တဲ့ သရုုပ္ေဆာင္ေတြကေတာ့ ဖ်ဴရီဇာတ္ကားရဲ႔ သတင္းစာရွင္းလင္းပြဲမွာေတာ့ စစ္ကိုုေတြ႔ၾကံဳခံစားရတဲ့ သာမန္မိသားစုုေတြလိုုပဲ ဖ်ဴရီတပ္ဖြဲ႔၀င္ေတြကလည္း သူတိုု႔ရဲ႔ တင့္ကားနဲ႔ မိသားစုု၀င္ေတြျဖစ္တဲ့ တင့္ကားအဖြဲ႔၀င္ေတြကိုု အခ်င္းခ်င္းကာကြယ္ေစာင့္ေရွာက္ပံုုကိုု ရိုုက္ကူးထားတာျဖစ္ေၾကာင္း ေျပာခဲ့ၾကပါတယ္။</span></p><p><span style=\"font-size: 12pt;\">ရုုပ္ရွင္အစအဆံုုး စစ္အနိဌာရံုုမ်ားကိုုလည္း ပီျပင္စြာ ၾကည့္ရမယ့္ဒီဇာတ္ကားက လက္ရွိမွာ&nbsp; IMDB rating 8.1 ရရွိထားပါတယ္။ မင္းသား ဘရက္ပစ္ ဦးေဆာင္ပါ၀င္ျပီး End of Watch (2012) , Training Day (2001), The Fast and Furious (2001) တိုု႔ရဲ႔ နံမည္ေက်ာ္ဒါရိုုက္တာ ေဒးဗစ္အိုုင္ယာက ထုုတ္လုုပ္သူ ဒါရိုုက္တာ အေနနဲ႔ရိုုက္ကူးထားတာျဖစ္ပါေၾကာင္း…</span></p><p><span style=\"font-size: 12pt;\">(ရုပ္ရွင္အညႊန္းကို mmmovieguide မွကူးယူေဖာ္ျပပါသည္။)</span></p>', '47,2272,2273,2374,2275,2276,2277,2278,2279,2280,2281,2282,2283,2284,2285,2286,2287,2288,2289,2290,2291,2375', '2295', '2295', '0', '2019-08-12', '4,68,70', '1,10,19', NULL, '135 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '7.4', 0, 1, 3, 3, 3, 4),
(51, 'tt1396484', 'It', NULL, 'it', '<p><span style=\"font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white;\">အညႊန္း</span></p><p><span style=\"font-size: 12pt;\"><br data-blogger-escaped-style=\"box-sizing: border-box;\">၁၉၈၈ ေအာက္တိုဘာလမွာေပါ့<br data-blogger-escaped-style=\"box-sizing: border-box;\">အကိုျဖစ္တဲ့ ေဘလ္တစ္ေယာက္က ညီေလးျဖစ္တဲ့ ေဂ်ာ္ဂ်ီေလးအတြက္စကၠဴေလွေလး<br data-blogger-escaped-style=\"box-sizing: border-box;\">တစ္စင္းကိုေပးလိုက္ၿပီးေတာ့ မိုးရြာထဲမွာ အကိုျဖစ္သူကေနမေကာင္းတဲ့အတြက္တစ္ေယာက္<br>တည္းထြက္ေဆာ့ဖို႔ျပင္ဆင္ခဲ့ပါတယ္။ အာ့လိုေဆာ့ရင္းနဲ႔ ေဂ်ာ္ဂ်ီတစ္ေယာက္<br>ေလွေနာက္အလိုက္လြန္ၿပီးလမ္းဆိုင္းဘုတ္တစ္ခုနဲ႔တိုက္မိၿပီးေတာ့လဲသြားခ်ိန္ ..<br>ေလွေလးကေရေျမာင္းထဲကိုက်သြားခဲ့ပါတယ္။</span></p><p><span style=\"font-size: 12pt;\"><!--more--></span></p><p><span style=\"font-size: 12pt;\" data-blogger-escaped-style=\"background-color: white;\">ဒီလိုနဲ႔ ေရေျမာင္းနားကိုသြားၿပီး ဆယ္မယ္လုပ္တဲ့အခါမွာ လူရႊင္ေတာ့တစ္ေယာက္နဲ႕ေတြ႕ပါတယ္။<br data-blogger-escaped-style=\"box-sizing: border-box;\">သူတို႕ ၂ ေယာက္စလံုးအျပန္အလွန္မိတ္ဆက္ၿပီးတဲ့အခါမွာ ေဂ်ာ္ဂ်ီက ေလွေလးယူဖို႔အခုိက္မွာ<br data-blogger-escaped-style=\"box-sizing: border-box;\">လူရႊင္ေတာ္က လက္ကို ကိုက္လိုက္ပါတယ္။ ထို႕ေနာက္ ေရေျမာင္းထဲကိုတစ္ခါတည္းဆြဲေခၚသြားပါေတာ့တယ္။<br data-blogger-escaped-style=\"box-sizing: border-box;\">ဒီအျဖစ္အပ်က္ကိုမယံုႏိုင္နဲ႔ ေဘလ္ တစ္ေယာက္ဟာ သူ႔ညီအတြက္ ရွာပံုေတာ္ဖြင့္ပါေတာ့တယ္။<br data-blogger-escaped-style=\"box-sizing: border-box;\">ဒီလိုနဲ႔…..<br data-blogger-escaped-style=\"box-sizing: border-box;\">ဒီဇာတ္ကားေလးဟာ ၁၉၈၆ ခုႏွစ္က Stephen King ေရးသားထုတ္ေဝခဲ့တဲ့ဝတၳဳစာအုပ္ကိုအေျခခံရိုက္ကူးထား<br data-blogger-escaped-style=\"box-sizing: border-box;\">တာျဖစ္ၿပီးေတာ့ IMDB 7.5 ရရွိထားတဲ့ကားေကာင္းေလးတစ္ကားဘဲျဖစ္ပါတယ္။</span></p>', '2376,2377,2378,2379,2380,2381,2382,2500,2384,2385,2386,2387,2388,2389,2390,2391,2392,2393,2394,2395,2396,2397,2398,2399,2400,2401,2402,2403,2404,2405,2406,2501,2408,2409,2410,2411,2412,2502,2414,2503,2416,2417,2418,2419,2420', '2421', '2422,2494,2495,2496', '0'