(52, 'tt0837562', 'Hotel Transylvania', NULL, 'hotel-transylvania', '<p>ေဟာ္တယ္ ထရန္စ္ဆန္ေဗးနီးယမ္း မွႀကိဳဆိုပါတယ္။ မြန္းစတားေတြနဲ႔သူတို႔ရဲ႕မိသားစုဝင္ေတြအတြက္သီးသန္႔ အပန္း<br>ေျဖစရာေနရာေလးတစ္ခုျဖစ္ၿပီးေတာ့၊ လူသားေတြလံုးဝမရွိတဲ့ သရဲသုခံဘံုေလးဘဲျဖစ္ပါတယ္။ တစ္ရက္မွာေတာ့<br>ပိုင္ရွင္ေသြးစုပ္ဖုတ္ေကာင္ဟာ သူရဲ႕ အခင္ဆံုးသူငယ္ခ်င္းေတြကို သူရဲ႕ သမီးေလး 118 ႏွစ္ေျမာက္ေမြးေန႔အတြက္ဖိတ္<br>ေခၚလိုက္ပါတယ္။ဒါေပမယ့္ မယံုၾကည္ႏိုင္စရာအျဖစ္အပ်က္တစ္ခုနဲ႔ႀကံဳေတြ႕ခဲ့ရတဲ့&nbsp;ေဟာ္တယ္ပိုင္ရွင္ ဒရက္ကူလာႀကီး<br>ဟာ သူ႔သူငယ္ခ်င္းေတြကိုမဟုတ္ဘဲ၊ သာမန္ေကာင္ေလးတစ္ေယာက္က&nbsp;ေဟာ္တယ္ထဲကိုရုတ္တရက္ဝင္လာတဲ့အခါ<br>မွာေတာ့.....<br></p>', '2504,2505,2506,2507,2508,2509,2510,2511,2512,2513,2514,2515,2516,2517,2518,2519,2520,2521,2522,2523,2524,2525,2526,2527,2544,2529', '2530', '2532,2532,2542,2543', '0', '2019-08-12', '68', '5,7,11,12', NULL, '91 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.9', 0, 1, 5, 5, 5, 6),
(53, 'tt2510894', 'Hotel Transylvania 2', NULL, 'hotel-transylvania-2', '<p>2012 က ေအာင္ျမင္ေက်ာ္ၾကားလူၾကိဳက္<wbr>မ်ားခဲ့လို႕ အခုသူ႕ရဲ႕ေနာက္ဆက္ 2015မွာ Part 2အေနနဲ႕ထပ္ထြက္လာတဲ့ Animation ကားေလးတစ္ခုကို တင္ေပးပါရေစ။IMDb Rating 7 အထိရရွိထားၿပီးတဲ့ ဒီကားေလးကို အားလံုးပဲေမွ်ာ္လင့္ေနၾကမွာ<wbr>ပါ။ ဒီဇာတ္ကားေလးဟာ မေကာင္းဆိုးဝါးေလးေတြနဲ႕ဇာတ<wbr>္လမ္းစထားခဲ့ၿပီး . Draculaဘုရင္တစ္ပါးရဲ႕သမီးေ<wbr>လးနဲ႕ခ်စ္ၾကိဳက္ခဲ့တဲ့ လူသားတစ္ဦးတို႕ရဲ႕&nbsp;<span class=\"text_exposed_show\">အခ်စ္ေမတၱာနဲ႕ ေပါင္းစပ္လက္တြဲမႈကို အခ်က္က်က်သေဘာက်ဖြယ္ ဖန္တီးထားပါတယ္။</span></p><p>Part 1 မွာ ခ်စ္ၾကိဳက္ခဲ့တဲ့ Dracula မေလး Mavis နဲ႕လူသားေလး Jonathan တို႕ရဲ႕ လက္ထပ္ မဂၤလာေဆာင္ပြဲကေနစထားပါတယ္။<wbr>&nbsp;Mavis နဲ႕ Jonတို႕ဟာ လက္ထပ္ၿပီးကာလတစ္ခုမွာ သားေလး တစ္ေယာက္ေမြးဖြားခဲ့ပါတယ္။</p><p>အထူးသျဖင့္ဒီဇာတ္ကားမွာေတြ႕<wbr>ရမွာက အဘိုးျဖစ္သူ Count Dracula ရဲ႕ သူ႕ ေျမးေလးအေပၚထားတဲ့ ခ်စ္ျခင္းေမတၱာကို လွလွပပဖြဲ႕ႏြဲ႕သြားခဲ့ၿပီး သူ႕လိုပဲေျမးေလးကိုေမွာ္အတတ<wbr>္ေတြကြ်မ္းက်င္တဲ့ Dracular ေလးတစ္ဦးျဖစ္ေစခ်င္တာကိုလည<wbr>္းေတြ႕ရပါမယ္။ Spoiler ျဖစ္သြားမွာစိုးလို႕ ဇာတ္ကားအေၾကာင္းကို ဆက္လက္မေျပာျပေတာ့ပါဘူး Movie သာဆက္လက္ၾကည့္ရႈၾကပါ။</p><p>ေခတ္နဲ႕ေလ်ာ္ညီေအာင္ တင္ဆက္ထားၿပီး . Sony Entertainment ကထုတ္လုပ္ထားတဲ့အတြက္ Sony Product မ်ားကိုပါ သံုးႏႈန္းသြားတာဟာ ေၾကာ္ျငာတဲ့ဘက္ကိုမသိသာေစဘဲ<wbr>&nbsp;ဟာသအျဖစ္နဲ႕တင္ဆက္ႏိုင္ခဲ့တ<wbr>ာပါ ဒီဇာတ္လမ္းကိုေရးသားခဲ့တဲ့ Robert Smigel နဲ႕ Adam Sandler တို႕ရဲ႕ ေျပာင္ေျမာက္တဲ့လက္ရာတစ္ခုပ<wbr>ါပဲ။ ဇာတ္ကားရဲ႕အသံပိုင္းဆိုင္ရာ<wbr>Qualityဟာေကာင္းလြန္းတာေၾကာ<wbr>င့္ ကြ်န္ေတာ္ Encoded လုပ္ရာမွာမူရင္း Sound Qualityကိုမက်ေအာင္အထူးသတိထ<wbr>ားၿပီးလုပ္ေပးထားပါတယ္။အဲ့အ<wbr>တြက္ Sound Box ေကာင္း၂ Speaker ေကာင္း၂ရွိသူမ်ားကေတာ့ အိမ္ခန္းထဲမွာတင္ရုပ္ရွင္ရံ<wbr>ုမွာၾကည့္ေနရသဖြယ္ခံစားေစရပ<wbr>ါမယ္။ ဒါရိုက္တာ Genndy Tartakovsky ရိုက္ကူးထားၿပီးရံုတင္ျပသခဲ<wbr>့ခ်ိန္မွာလည္းေအာင္ျမင္တဲ့က<wbr>ား<br>တစ္ကားျဖစ္ေနပါတယ္။</p><p>အဲ့ထက္ပိုစိတ္ဝင္စားဖို႕ေကာ<wbr>င္းတာက အသံပိုင္းဆိုင္ရာသရုပ္ေဆာင္<wbr>မ်ားပါပဲ . ဇာတ္ညႊန္းေရးဆရာ ၂ ဦးလံုးဟာဇာတ္ညႊန္းေရးေပးရံ<wbr>ုမကဘဲ Count Dracula ေနရာမွာ Adam Sandler ကသရုပ္ေဆာင္ၿပီး . Jonathan ေနရာမွာ Robert Smigelတို႕ကသရုပ္ေဆာင္ေပးထာ<wbr>းပါတယ္။ေနာက္ထပ္တစ္ေယာက္<br>ကေတာ့ 2012 Part 1 ထြက္တုန္းက က်ြန္ေတာ္တို႕လံုးဝသတိမထားမ<wbr>ိခဲ့ပါဘူး။ Dracula မေလး Mavisရဲ႕ ေနရာကိုအသံသရုပ္ေဆာင္ေပးတာဟ<wbr>ာ မင္းသမီးေခ်ာေလး Selena Gomez ပါပဲ။<br>( ဇာတ္လမ္းအညႊန္းကို San Win Maung မွ ေရးသားေပးထားပါတယ္ )</p>', '2504,2505,2506,2507,2509,2511,44,2545,2508,2510,2546,2547,2548,2520,2549,2523,2550,2513,2551,2514,2522,1687,2552,2553,2515,2554,2555,2521,2556,2516,2557,2558,2581,2560,2561,2562,2563,2582,2565,2566,2567,2568,2569,2570,2571,2572,2573,2574', '2530', '2530,2532,2575,2543,2542', '0', '2019-08-12', '68', '5,7,11,12', NULL, '89 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.7', 0, 1, 8, 8, 8, 9),
(54, 'tt7245176', 'Paradox', NULL, 'paradox', '<p>ကဲဒီတစ္ေခါက္ေတာ့ မၾကည့္ရေသးတဲ့သူေတြအတြက္ Action Drama နဲ႕ Thriller အမ်ိဳးအစားေလးကို<br>တင္ဆက္ေပးလုိက္ပါတယ္</p><p>ဒီဇာတ္ကားမွာ ထိုင္းမင္းသားလည္းပါ၀င္ေပးထားတဲ့ဇာတ္ကားတစ္ကားပါ<br>ၾကမ္းမွၾကမ္းဆိုတဲ့သူေတြ ဒီဇာတ္ကားမ်ိဳးၾကည့္သင့္ပါတယ္</p><p>အညြန္း</p><p>အစပိုင္းမွာ သမီးေလးေပ်ာက္ဆုံးသြားလို႕ ဖခင္ေဇာ္နဲ႕ စိတ္ပူျပီး ေသာကေတြမ်ားေနတဲ့ ဖခင္တစ္ေယာင္က<br>သူ႕သမီးေလးကို ျပန္ရွာဖို႕အတြက္ တရုတ္ႏိုင္ငံကေနျပီးေတာ့ ထုိင္းႏိုင္ငံကိုေရာက္ရွိလာခဲ့တယ္</p><p>အဲ့အခ်ိန္မွာ ထိုင္းရဲႏွစ္ေယာက္ကလည္း သူ႕ကိုကူညီႏိုင္ပါ့မလား<br>သူ႕သမီးကိုေရာ္ အဲ့ဒီမွာ ျပန္ေတြ႕ပါ့မလား.........ဆိုတာကိုေတာ့........</p><p>ထပ္ညြန္းပါရေစ ၾကည့္ျဖစ္ေအာင္ ၾကည့္လုိက္ပါ</p>', '2583,2584,2585,2586,2587,2588,2589,2590,2591,2592,2593,2594,2595', '2596', '2597,2639', '0', '2019-08-12', '18', '1,8,10', NULL, '101 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.4', 0, 1, 7, 7, 7, 8),
(55, 'tt2338151', 'PK', NULL, 'pk', '<p>India ႏုိင္ငံ Rajasthan သဲကႏာၱရတစ္ေနရာ....<br>ေရြ႔လ်ားေနေသာတိမ္တိုက္ႀကီးတစ္ခုေျမျပင္သို႔ တျဖည္းျဖည္းခ်ဥ္းကပ္လာေနပါတယ္<br>တိမ္တိုက္အတြင္းမွာေတာ့ ပန္းကန္ျပားပ်ံသ႑ာန္ယာဥ္ပ်ံတစ္စင္း<br>အဆိုပါယာဥ္ထဲမွ ဝတ္လစ္စလစ္ႏွင့္ လူသားသ႑ာန္တစ္ခုဆင္းလာပါတယ္<br>ထို႔ေနာက္ယာဥ္ပ်ံကျပန္လည္ထြက္ခါသြားပါေတာ့တယ္</p><p>သူ႔လည္ပင္းမွာေတာ့ အလင္းေရာင္ေတြထြက္ေနတဲ့အဝိုင္းျပားတစ္ျပားကို ဆဲြႀကိဳးအျဖစ္ဆဲြထားပါတယ္<br>အဆိုပါဆဲြႀကိဳးဟာ သူ႔အတြက္ သူ႕ယာဥ္ပ်ံနဲ႔ျပန္လည္ဆက္သြယ္ရာမွာအသံုးျပဳတဲ့ remote control ဆိုလည္းမမွားပါဘူး</p><p>ကမ႓ာႀကီးကသူ႔အတြက္ေတာ့ မရင္းႏီွးေသးတဲ့ပတ္ဝန္းက်င္တစ္ခုေပါ့<br>India အမ်ိဳးသားႀကီးတစ္ေယာက္ကို သူေတြ႔တဲ့အခါ ထိုအမ်ိဳးသားႀကီးဆီသူေလ်ွာက္သြားတယ္<br>ထိုအမ်ိဳးသားႀကီးက သူ႔လည္ပင္းကဆဲြႀကိဳးကို ျဖဳတ္လုျပီး ခုတ္ေမာင္းလာေနတဲ့ ရထားတဲြေပၚေျပးတက္လိုက္ပါသြားတယ္<br>သူလည္းသူ႔ဆဲြႀကိဳးေလးျပန္ရဖို႔ႀကိဳးစားရင္ ထိုအမ်ိဳးသားႀကီးဆီက ေရဒီယိုေလးတစ္လံုးကို ျပန္ရခဲ့ပါတယ္</p><p>သဲကႏၲာရအလယ္<br>အျခားကမ႓ာက ဝတ္လစ္စလစ္ျဂိဳလ္သားတစ္ေယာက္<br>ေရဒီယိုေလးတစ္္လံုးပိုက္လို႔</p><p>သူေနထိုင္ရာျဂိဳလ္ဆီျပန္ဖို႔ remote control ကလည္းေပ်ာက္ဆံုးသြားခဲ့ျပီ<br>လူသားေတြရဲ႕အေလ့အထ ကမ႓ာႀကီးရဲ႕ ယဥ္ေက်းမႈပညတ္ေတြ ဘာသာစကားေတြ ဘာမွနားမလည္တဲ့ သူ႔အဖို႔ ဒီ remote control ေလးကို ဘယ္လုိျပန္ရွာေဖြမွာလဲ</p><p>လူေတြကေတာ့ သူ႔ကို PK လို႔ေခၚၾကတယ္<br>သူေနထိုင္ရာ ျဂိဳလ္မွာ ဘာသာစကားမရိွဘူး<br>အဝတ္အစားမဝတ္ဘူး အေတြးနဲ႔စကားေျပာၾကတယ္<br>သူ႔မွာအမည္နာမ မရိွဘူး<br>လူသားေတြလို စကားတစ္ခြန္းေၾကာင့္ နားလည္မႈလဲြျပီးအမုန္းေတြမပြားၾကဘူး</p><p>PK အတြက္ေတာ့ လူသားေတြလို ျပဳမူေနထိုင္ႏိုင္ဖုို႔ေတာ္ေတာ္ေလ့လာသင္ယူခဲ့ရတယ္<br>အဝတ္အစားကိုမွန္ကန္ေအာင္ဝတ္ႏိုင္ဖို႔ ေငြေၾကးေတြသံုးစဲြဝယ္ယူတတ္ဖို႔နဲ႔ ဘာသာစကားေတြကို ေျပာဆိုတတ္ဖုိ႔ သူ႔အတြက္ ေျခာက္ပတ္တိတိေလ့လာခဲ့ရတယ္</p><p>PK ရဲ႕ ထူးျခားတဲ့အမူအက်င့္ေတြကို သတိထားမိခဲ့သူ သတင္းေထာက္မေလး Jaggu ဟာ PK အေၾကာင္းကို သိရဖို႔ၾကိဳးစားပါေတာ့တယ္</p><p>PK အတြက္မ႓ာေပၚမွာ ဘယ္လိုအေတြ႔အၾကံဳေတြကိုဆက္လက္ေတြ႔ရမွာလဲ<br>သူ႔ remote control ေလးကို ျပန္ရွာေတြ႔ႏိုင္မွာလား</p><p>.......</p><p>PK ဇာတ္ကားဟာ 2014 ခုႏွစ္ထြက္ Bollywood ရုပ္ရွင္ဇာတ္ကားတစ္ကားျဖစ္ျပီး Ghajini (2008), 3 Idiots (2009) နဲ႔ Dhoom 3 (2013) စတဲ့ဇာတ္ကားေတြနဲ႔ ေအာင္ျမင္ခ့ဲတဲ့ မင္းသား Aamir Khan ကေခါင္းေဆာင္ပါဝင္ထားျပီး မင္းသမီး Anush Sharma နဲ႔အတူ ဒါရိုက္တာ Rajkumar Hirani ကရိုက္ကူးေပးထားတာပါ</p><p>Vinod Chopra Films မွထုတ္လုပ္ျပီး UTV Motion Pictures မွ 2014 ခုႏွစ္ December 19 ရက္တြင္ ျဖန္႔ခ်ိေပးခဲ့ရာ ျဖန့္ခ်ိျပီး ၂ ပတ္အတြင္းမွာပင္ India ႏုိင္ငံရဲ႕ ရုပ္ရွင္သမိုင္းတစ္ေလ်ာက္ ဝင္ေငြအေကာင္းဆံုးဇာတ္ကားအျဖစ္ ရပ္တည္ႏိုင္ခ့ဲျပီး ကမ႓ာတစ္ဝွမ္း 2014 ခုႏွစ္ထြက္ရိွသမ်ွဇာတ္ကားေတြထဲမွာေတာ့ ဝင္ေငြအေကာင္းဆံုး နံပါတ္ ၆၅ အျဖစ္ရပ္တည္ေနပါတယ္</p><p>ရုိက္ကူးထုတ္လုပ္မႈစရိတ္ ေဒၚလာ ၁၃ သန္းကုန္က်ခဲ့တဲ့ PK ရုပ္ရွင္ဇာတ္ကားဟာ အခုခ်ိန္ထိဝင္ေငြ ၉၂ သန္းေက်ာ္ ျပန္လည္ရိွထားပါတယ္</p><p>ဘာသာေရးနဲ႔ ပတ္သက္ျပီး သေရာ္ထားတဲ့ဇာတ္ဝင္ခန္းေတြေၾကာင့္ ေဝဖန္ခံရမႈေတြရိွခဲ့ေပမယ့္ PK ဇာတ္ကားဟာ က်ြန္ေတာ္တို႔ေတြ ေန႔စဥ္ဘဝမွာ အျမဲတမ္းႀကံဳေတြ႔ေနရတဲ့ ေလာဘ ေဒါသ ေမာဟေတြ နဲ႕ ဘာသာေရးကိုခုတံုးလုပ္မႈေတြ လဲြမွားစြာကိုးကြယ္ယံုၾကည္မႈေနတဲ့ အစြန္းေရာက္လြန္းလွတဲ့ အယူအဆအခ်ိဳ႕ကိုပါ လွပစြာမီးေမာင္းထုိးျပႏိုင္ခ့ဲပါတယ္</p><p>က်ြန္ေတာ္တို႔ေတြေရာရိုးသားစြာယံုၾကည္သက္ဝင္ေနၾကတာလား<br>ေသေသခ်ာခ်ာေတြးေတာၾကည့္ျဖစ္ၾကရဲ႕လား<br>လဲြမွားေနတဲ့ အယူအဆအေဟာင္းေတြေနာက္လုိက္မိေနၾကျပီလား</p><p>PK နဲ႔အတူအေတြးနယ္ခ်ဲ႕ၾကည့္ရေအာင္လားဗ်ာ....</p>', '2640,2641,2642,2643,2644,2645,2646,2647,2648,2649,2650,2651,2652,2653,2654,2655,2656,2657,2658', '2661', '2664', '0', '2019-08-12', '10', '7,10', NULL, '153 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '7.7', 0, 1, 5, 5, 5, 6),
(56, 'tt2231461', 'Rampage', NULL, 'rampage', '<p>အေမရိကန္ အထူးတပ္ဖြဲ႕ ဝင္ေဟာင္းတစ္ဦးျဖစ္တဲ့ ေဒးဗစ္အိုေကြဟာ ဆန္ဒီေရးဂိုးေတာ႐ိုင္း တိရစၧာန္ ကာကြယ္ေစာင့္ေရွာက္ ေရးဌာနက ေဂၚရီလာေမ်ာက္ဝံ ေတြနဲ႔ပတ္သက္ၿပီး သုေတသန ျပဳေနတဲ့ နာမည္ႀကီး ပညာရွင္ တစ္ေယာက္ပါ။</p><p>မုဆိုးေတြလက္ကေန ကယ္ ဆယ္လာခဲ့တဲ့ ေဂ်ာ့ခ်္ဆိုတဲ့ ေဂၚရီ လာေမ်ာက္ဝံျဖဴႀကီးဟာ သာမန္ ေမ်ာက္ဝံေတြနဲ႔မတူဘဲ ထူးျခားတဲ့ အသိဉာဏ္ဖြံ႕ၿဖိဳးမႈမ်ိဳးရွိေနတယ္ဆုိတာ ေဒးဗစ္က သတိထားမိၿပီး ေဂ်ာ့ခ်္နဲ႔လည္း ရင္းႏွီးခဲ့ပါတယ္။</p><p>တစ္ရက္မွာေတာ့ ေဂ်ာ့ခ်္ ေနတဲ့ေနရာကို ထူးဆန္းတဲ့ ပစၥည္းတစ္ခုက်လာၿပီး အဲဒါကို ေဂ်ာ့ခ်္ က ထိလိုက္တဲ့အခါမွာေတာ့ ည တြင္းခ်င္းမွာကို ေဂ်ာ့ခ်္စိတ္႐ိုင္း ဝင္ကာ ခႏၶာကိုယ္အရြယ္အစား ကလည္း အႀကီးႀကီးျဖစ္သြားခဲ့ပါ တယ္။</p><p>အဲဒီေနာက္မွာေတာ့ ေဒးဗစ္ ကို မ်ိဳး႐ိုးဗီဇဆုိင္ရာ ပညာရွင္ ေဒါက္တာကိတ္ကဲလ္ဝဲက ဆက္ သြယ္ၿပီး ေဂ်ာ့ခ်္ အခုလိုျဖစ္သြား တာဟာ Energyne ကုမၸဏီက စမ္းသပ္ထားတဲ့ သေႏၶေျပာင္း ပစၥည္းေၾကာင့္လို႔ေျပာပါတယ္။</p><p>ေဒါက္တာကိတ္ကိုလည္း Energyne ကုမၸဏီက အလုပ္ ထုတ္ပစ္ခဲ့သလို ကုမၸဏီနဲ႔ စမ္း သပ္မႈေတြကို ထုတ္ေျပာလုိ႔ဆုိၿပီး ေထာင္ခ်ပစ္ဖို႔အထိပါ လုပ္ခဲ့ပါ တယ္။</p><p>ေဂ်ာ့ခ်္ကို ေအးဂ်င့္ဟာေဗး ရက္ဆဲလ္ဦးေဆာင္တဲ့ အစိုးရ အဖြဲ႕အစည္းက ေလယာဥ္နဲ႔ ဖမ္း ဆီးေခၚေဆာင္သြားေပမယ့္ ေလယာဥ္ကို ဖ်က္ဆီးၿပီး ေဂ်ာ့ခ်္လြတ္ ေျမာက္သြားသလို ရက္ဖ္ဆိုတဲ့ သေႏၶေျပာင္း ဝံပုေလြႀကီးက လည္း သူ႔ကိုလိုက္ဖမ္းတဲ့အဖြဲ႕ကို အျပတ္ရွင္းပစ္ခဲ့ပါတယ္။</p><p>အဲဒီေနာက္ ေဂ်ာ့ခ်္နဲ႔ ရက္ဖ္ တုိ႔ ေပါင္းမိၿပီး ခ်ီကာဂိုၿမိဳ႕ေတာ္ ကို ဝင္ေရာက္ဖ်က္ဆီး တိုက္ခိုက္ ခဲ့ပါေတာ့တယ္။ ျပႆနာက အဲဒီ မွာတင္ မၿပီးေသးပါဘူး။ ကုန္းေပၚမွာ ေဂ်ာ့ခ်္နဲ႔ ရက္ဖ္တို႔ တိုက္ ခိုက္ဖ်က္ဆီးေနသလို လစ္ဇီဆုိ တဲ့ သေႏၶေျပာင္း မိေက်ာင္းႀကီး ရန္ကလည္း ထပ္ေပၚလာပါေတာ့ တယ္။</p><p>ေဒးဗစ္နဲ႔ ေဒါက္တာကိတ္ ဟာ စိတ္႐ိုင္းဝင္ၿပီး ေတြ႕သမွ် အႏၲရာယ္ျပဳေနတဲ့ သေႏၶေျပာင္း သတၱဝါေတြကို ပံုမွန္အေျခအေန ျပန္ျဖစ္ေအာင္ လုပ္ႏိုင္မယ္လို႔ ယံုၾကည္ထားကာ ထိန္းခ်ဳပ္ႏိုင္ဖို႔ အသည္းအသန္ ႀကိဳးပမ္းခဲ့ၾကပါ တယ္။</p><p>သေႏၶေျပာင္း သတၱ၀ါေတြ က ဘယ္လိုေတြ ဒုကၡေပးမွာလဲ၊ ေဒးဗစ္တို႔ ယံုၾကည္ထားသလို ေဂ်ာ့ခ်္ကို မူလအေနအထားျဖစ္ ေအာင္ ျပန္လုပ္ႏိုင္ပါ့မလားဆို တာကို အမုိက္စား အထူးျပဳလုပ္ ခ်က္ေတြ၊ အက္ရွင္ျပကြက္ေတြနဲ႔ ႐ိုက္ကူးထားတာမို႔ ပရိသတ္ေတြ သေဘာက်မွာပါ။</p><p>ပရိသတ္အခ်စ္ေတာ္ အက္ ရွင္မင္းသားႀကီး ဒ၀ိန္းဂြၽန္ဆင္က အဓိက သ႐ုပ္ေဆာင္ထားတာျဖစ္ ၿပီး နာအုိမီဟားရစၥ၊ မာလင္အ ကာမန္၊ ဂ်က္ဖရီးဒင္းန္ေမာ္ဂန္၊ ဂ်ိတ္ခ္ေလစီ၊ ဂ်ိဳးမန္ဂါနီလို စသူ ေတြပါ၀င္ထားပါတယ္။</p><p>&nbsp;</p><p>(ဇာတ္လမ္းအညႊန္းကိုေတာ့ 7daydaily မွကူးယူေဖာ္ျပထားတာျဖစ္ပါတယ္)</p>', '1384,2677,2825,2679,2680,2681,2682,2826,2684,2685,2686,2687,2688,2689,2690,2691,2692,2693,2694', '2695', '2696,2697,2698,2824,2697', '0', '2019-08-12', '68', '1,4,12,42', NULL, '107 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.2', 0, 1, 11, 11, 11, 12),
(57, 'tt4061196', 'Until Forever', NULL, 'until-forever', '<p>IMDB -- 6.3/10</p><p>Michelle Larson အျဖစ္ မင္းသမီးေခ်ာေခ်ာေလး Madison Lawor သရုပ္ေဆာင္ထားပါတယ္<br>မင္းသားကိုေတာ့ ထည့္ေျပာမေနေတာ့ဘူး ကြကိုရွာၾကည့္ပါ အယ့္လယ္</p><p>ဒီဇာတ္ကားေလးက ျဖစ္ရပ္မွန္ကို အေျချပဳျပီးရိုက္ကူးထားတာပါ<br>ဟုတ္ပါတယ္ ဒီဇာတ္လမ္းရဲ႕ ေနာက္ဆုံးမွာ အျပင္မွာတကယ္ျဖစ္ခဲ့တာကို ရိုက္ကူးထားတဲ့ Video ဖုိင္ေလးထည့္ေပးထားပါတယ္</p><p>ဇာတ္ညြန္း<br><b>*****</b></p><p>Michael Boyum ဆိုတဲ့ေကာင္ေလးရဲ႕ ျဖစ္ရပ္မွန္အခ်စ္ဇာတ္လမ္းေလးပါ<br>သူကိုးကြယ္တဲ့ ဘုရားသခင္အေပၚမွာ အျပည့္အ၀ကို ယုံၾကည္ထားတယ္<br>ေျပာရမယ္ဆိုရင္ ဘုရားတရားကိုင္းရွိုင္းတဲ့လူတစ္ေယာက္ေပါ့</p><p>Michelle Larson ဆိုတဲ့ ေကာင္မေလးနဲ႕ အမွတ္မထင္ေတြ႕မိသြားၾကရာကေန<br>ျမင္ျမင္ခ်င္း ခ်စ္စိတ္ေတြ ေပါက္ဖြားလာၾကတယ္(Puppy Love)</p><p>ဒီလိုနဲ႕ေနာက္ပိုင္း ရည္းစားေတြျဖစ္ျပီး တရား၀င္တဲြၾကတယ္<br>လူတိုင္းကလည္း သူတို႕အတြဲကို သေဘာတူၾကတယ္ အားက်ၾကတယ္</p><p>ဒါေပမယ့္ အဖက္ဖက္က ေျပာစရာမရွိေလာက္ေအာင္ကို ျပည့္စုံေနေပမယ့္<br>ေရာဂါကံၾကမၼာဆိုး တစ္ခုက တံခါးမေခါက္ တုန္းမေခါက္ပဲ ၀င္လာခဲ့တယ္ အယ့္လယ့္</p><p>ဒီဇာတ္ကားမွာ ေလးစားစရာေကာင္းတဲ့သူက Michelle Larson ပါပဲ</p><p>ကြ်န္ေတာ္ေတြ႕ဖူးတဲ့ မိန္းကေလးေတြအမ်ားစုကေတာ့</p><p>ပိုက္ဆံကို ၾကည့္ၾကတာမ်ားတယ္</p><p>ရုပ္မေခ်ာရင္ေနပါေစ ဥစၥာေပါရင္ ရျပီ</p><p>သြားမပါရင္ေနပါေစ ကားပါရင္ရျပီ ဆိုတဲ့သူေတြၾကည့္ပဲ</p><p>ဒီဇာတ္ကားကို ဘာသာျပန္ေနရင္း ကြ်န္ေတာ္မယုံေသးဘူး Michelle Larson ကို</p><p>သူ႕ရဲ႕အခ်စ္က အဲ့ေလာက္ေတာင္ပဲလားေပါ့</p><p>ဒီဇာတ္ကားဒါရိုက္တာက လုပ္ၾကံျပီး ရိုက္ထားတာေပါ့ အဲ့ဒါနဲ႕ အဆုံးသတ္လည္းေရာက္ေရာ<br>အျပင္မွာတကယ္ျဖစ္ခဲ့တဲ့ သက္ေသ Video ဖိုင္ေလးကိုထည့္ေပးထားတယ္ အဲ့ဒါေလးၾကည့္ၾကည့္ေတာ့မွ</p><p>တကယ္ေလးစားသြားတယ္<br>စဥ္းစားၾကည့္ေလဗ်ာ</p><p>ရည္းစားသက္တမ္းပဲရွိေသးတဲ့ လူတစ္ေယာက္ ေသြးကင္ဆာျဖစ္ေနတဲ့ လူတစ္ေယာက္<br>ေသလုနီးပါးျဖစ္ေနတဲ့ လူတစ္ေယာက္ကို သူ႕အေနနဲ႕<br>မဂၤလာေဆာင္ျပီး ခင္ပြန္းေယာက်ာ္းအျဖစ္ က်န္ရွိေနေသးတဲ့ Michael Boyum ရဲ႕သက္တမ္းမွာ<br>ေပ်ာ္ရြင္ေအာင္ထားေပးႏိုင္ခဲ့တယ္</p><p>ေတာ္ရုံတန္ရုံမိန္းကေလးတစ္ေယာက္<br>ရွင့္ကိုမွ အရမ္းခ်စ္ပါတယ္ဆိုတဲ့ မိန္းကေလးတစ္ေယာက္ကိုေမးၾကည့္ပါ</p><p>တကယ္လို႕မ်ား ကိုယ့္မွာေရာဂါတစ္ခုခံစားေနရျပီး ေသခံနီးျဖစ္ေနရင္ေရာ္<br>ခ်စ္ဦးမွာလားလို႕</p><p>အရင္လိုပဲ ကိုကို လို႕ ေခၚဦးမွာလား<br>ေမာင္ လို႕ ေခၚဦးမွာလား ဒါမွမဟုတ္ တျခားတစ္ေယာက္ေျပာင္းသြားမွာလား ဆိုတာေတာ့ ကြကိုယ္ပဲစမ္းၾကည့္ၾကေပါ့<br>ကြ်န္ေတာ္က အၾကံေပးရုံသက္သက္ပါ<br>ျဖစ္လာတဲ့ ျပသာနာကိုေတာ့ တာ၀န္မယူပါဘူး</p><p>Do at your Own Risk ပါပဲ</p><p>Michael Boyum ကလည္းေျပာပါေသးတယ္</p><p>မင္းကိုယ္နဲ႕ လက္ထပ္ရင္ မင္းဘ၀အတြက္ အာမခံရမွာမဟုတ္ဘူးေနာ္<br>မင္းနဲ႕အတူ ရွိေနေပးႏိုင္မယ့္ သူတစ္ေယာက္ကိုပဲ လက္ထပ္လုိက္ပါ<br>မင္းဘ၀ေလး အဆင္ေျပေအာင္လို႕ပါ</p><p>လို႕ေျပာေပမယ့္လည္း Michelle Larson ကသူ႕ရဲ႕အခ်စ္ေတြဟာ အေပၚယံၾကက္ဥအကာမဟုတ္ေၾကာင္း<br>ေငြကိုမက္ျပီး ရည္းစားထားတာမဟုတ္ေၾကာင္း ဒီလုိျပသာနာေတြျဖစ္လာမွ ေခ်ာင္ေျပးတတ္တဲ့သူမဟုတ္ေၾကာင္း<br>သက္ေသျပသြားႏိုင္ခဲ့တယ္</p><p>ေနာက္ဆုံးပိုင္းမွာေျပာခဲ့တဲ့စကားေလး တစ္ခြန္းကိုသေဘာက်တယ္<br>ေယာက်ာ္းေလးတိုင္းရဲ႕အိပ္မက္တစ္ခုလိုေပါ့</p><p>\"Marry Me\" တဲ့ Michelle Larson ဘက္ကေျပာလိုက္တဲ့စကားေလးတစ္ခြန္းေၾကာင့္</p><p>Michael Boyum က ဆြံ႕အသြားခဲ့တယ္</p><p>ဘာပဲျဖစ္ျဖစ္ Michelle Larson ကို ကြ်န္ေတာ္ ဒီဇာတ္ကားေလးနဲ႕ ေလးစားသမွုျပဳလုိက္ရပါတယ္</p><p>ထပ္ညြန္းပါရေစ ၾကည့္ျဖစ္ေအာင္ ၾကည့္ေပးပါ</p><p>ဘယ္သူေတြၾကည့္သင့္လဲဆိုေတာ့<br><b>**********************</b></p><p>&gt; မိမိနဲ႕ ခံစားခ်က္ခ်င္းတူတဲ့သူေတြ<br>&gt; လက္ရွိ မိမိက ေစာင္ FA ျဖစ္ေနတဲ့သူေတြ<br>&gt; လက္ရွိမွာ RS ရွိျပီး သူတို႕လိုျဖစ္ရင္ဘယ္လိုရင္ဆိုင္ရမလဲဆိုတာကို သိခ်င္တဲ့သူေတြ<br>&gt; လက္ရွိမွာ LDRS ျဖစ္ေနျပီး လြမ္းေနရပါတယ္ ေဆြးေနရပါတယ္ဆိုတဲ့သူေတြ<br>&gt; ယခုလက္ရွိအေျခအေနမွာ ရွိေနတဲ့ ရည္းစားေလးနဲ႕ သက္ဆုံးတုိင္ ေပါင္းသင္းသြားပါ့မယ္<br>ဘာေတြပဲျဖစ္လာျဖစ္လာ ရင္ဆုိင္မယ္ဆုိတဲ့ သူေတြ</p><p>အညႊန္းနဲ႔ ဘာသာျပန္သူကေတာ့ Sai Wunna ဘဲျဖစ္ပါတယ္။</p>', '2827,2828,2829,2830,2831,2832,2833', '2833', '2833', '0', '2019-08-12', '68', '10,39', NULL, '100 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.2', 0, 1, 6, 6, 6, 7),
(58, 'tt6409762', 'Big Legend', NULL, 'big-legend', '<p>စစ္ျပန္တစ္ေယာက္ျဖစ္တဲ့ Tyler ဟာသူရဲ႕ ခ်စ္သူျဖစ္တဲ့ Natalie နဲ႔အတူ လူသူမရွိတဲ့&nbsp;ေတာအုပ္တစ္ခုထဲကို<br>ေပ်ာ္ပြဲစားထြက္လာရင္း အမွတ္မထင္ ကံၾကမၼာဆိုး တစ္နဲ႔ႀကံဳေတြ႕ၿပီးေတာ့ Natalie ကေပ်ာက္ဆံုးသြားခဲ့ပါတယ္၊<br>ဒီလိုနဲ႔ေတာထဲမွာ&nbsp;ေပ်ာက္သြားတဲ့ ခ်စ္သူ Natalie ကိုဘယ္လိုမ်ားရွာေဖြမလဲ၊ ရွာေဖြရင္းနဲ႔ ဘာေတြဆက္ျဖစ္မလဲ...<br>ဆိုတာကိုေတာ့ ရုပ္ရွင္ ထဲမွာဆက္လက္အားေပးရင္းၾကည့္ရႈၾကရေအာင္ဗ်ာ။</p><p>ဘာသာျပန္သူကေတာ့ Sai Wunna ဘဲျဖစ္ပါတယ္။</p>', '2838,2861,2840,2841,2842,2843,2844,2845', '2846', '2846', '0', '2019-08-12', '68', '1,14,18', NULL, '89 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '5.7', 0, 1, 23, 23, 23, 24),
(60, '', 'Kidnap', NULL, 'kidnap', '<p>2017 March လတုန္းက ထြက္ထားတဲ့ ဇာတ္ကားေလးပါ ... ဇာတ္လမ္းကေတာ့ အေထြအထူး ေျပာစရာမရွိပါဘူး ... Single Mother တစ္ေယာက္ျဖစ္တဲ့ Karla Dyson ဟာ သူ႕သားျဖစ္တဲ့ Frankie Dyson ကို အရမ္းခ်စ္တဲ့ မိခင္တစ္ေယာက္ပါ ... စားေသာက္ဆိုင္တစ္ခုမွာ စားပြဲထိုးလုပ္ကိုင္ၿပီး သားျဖစ္သူရွိရင္ ဘ၀ကို ျပည့္စံုေနၿပီလို႕ ထင္ေနသူလည္း ျဖစ္ပါတယ္ ... တစ္ရက္ သူ႕သားေလးကို ကစားကြင္းလိုက္ပို႕ရင္း သားေလးကို ျပန္ေပးဆြဲခံလိုက္ရပါတယ္ ...တျခားသူေတြသာဆို ရဲစခန္းကိုပဲ ဦးတည္သြားႏိုင္ေပမယ့္ Karlaကေတာ့ ျပန္ေပးဆြဲသမားေနာက္ကို ထပ္ခ်ပ္မကြာလိုက္ရင္း သူ႕သားကို ျပန္လည္ရရွိဖို႕ ႀကိဳးပမ္းခဲ့ပါတယ္ ... ဇာတ္လမ္းကေတာ့ သားကိုခ်စ္တဲ့ မိခင္တစ္ေယာက္ရဲ႕ ေမတၱာ၊ ဘယ္ေတာ့မွ ကိုယ့္ရင္ေသြးအေပၚကို လက္လႊတ္ဆံုးရံႈးမခံႏိုင္ပဲ ေရကန္ေရခမ္း သားျဖစ္သူျပန္ရဖို႕ ဘာမဆို ႀကိဳးစားခဲ့တဲ့ Karla ရဲ႕ ေမတၱာကို ျမင္ေတြ႕ရမွာျဖစ္ပါတယ္ </p>', '2883,2884,2885,99,2886,2887,2888,2889,2890,2891,2892,2893,2894,2895,2896,2897,2898,2899,2900,2901,2902,2903,2904,2905', '2907', '2909', '0', '2017-08-04', '68,70', '10,18', NULL, '95 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.1', 0, 1, 11, 11, 11, 12),
(61, '', 'King Arthur: Legend of the Sword', NULL, 'king-arthur-legend-of-the-sword', '<p>King Arthur:Legend of the Sword (2017) (PG-13)<br>----------------------------------------------</p><p>~~~Storyline~~~</p><p>လြန္ခဲ့ေသာ ႏွစ္ေပါင္းမ်ားစြားတည္းက လူသားေတြနဲ႔ ေမွာ္ဆရာေတြဟာ အတူတူလက္တြဲ ၿပီးေနထိုင္လာခဲ့တာ ၾကာခဲ့ၿပီျဖစ္တယ္...King Uther အုပ္ခ်ဴပ္ေနခ်ိန္ ကာလမွာ သူ႕ကိုမလိုလားတဲ့ လူေတြေၾကာင့္ ေမွာ္ဆရာေတြနဲ႕ လူေတြၾကား စစ္ပြဲေတြ ျဖစ္ခဲ့တယ္..အဲ့ထဲမွာမွ Uther ကို မလိုလားဆံုး သူေတြ ထဲမွာ သူ႕ညီ Vortigern လည္းအပါဝင္ ျဖစ္တယ္..သူ႕အကိုရဲ႕ ဘုရင္ေနရာကို သိမ္းပိုက္ၿပီး အာဏာရွင္ ဆန္ဆန္ အုပ္ခ်ဳပ္ခ်င္ေနတဲ့သူလည္း ျဖစ္တယ္ ...ဘုရင္ ျဖစ္ဖို႕အတြက္ဆို ဘာမဆို လုပ္မဲ့ Vortigern ဟာ သူ႕အကိုကို လုပ္ၾကံသတ္ျဖတ္ခဲ့ပါတယ္...King Uther မွာ သားတစ္ေယာက္ ရွိခဲ့တယ္..အဲ့ကေလးေလးဟာ သူ႕အေဖ ေသဆံုးတဲ့ ညမွာတင္ ျဖစ္ပ်က္ခဲ့တာေတြ တစ္ခုမွ မမွတ္မိခဲ့ဘဲ တစ္ဖက္ႏိုင္ငံသို႕ ေရာက္ရွိသြားခဲ့ပါတယ္..အဲ့ကေလးဟာ တစ္ခ်ိန္မွာ ဘုရင္ျဖစ္မယ့္ Arthur ျဖစ္လာခဲ့တာပါပဲ..</p><p>Arthur အသက္ႀကီးလာတဲ့အခ်ိန္ထိ သူငယ္ငယ္တုန္းက ျဖစ္ပ်က္ခဲ့တာေတြ တစ္ခုမွတ္မိခဲ့ျခင္း မရွိတဲ့အတြက္ သာမန္ ဘဝတစ္ခုနဲ႕ပဲ ေနလာခဲ့တယ္...ဒါေပမဲ့ တစ္ေန႔မွာ King Vortigern အုပ္ခ်ဴပ္ေနစဥ္ သူတိုင္းျပည္ရဲ႕ပင္လယ္ေရေတြထဲကေန King Uther ရဲ႕ဓားဟာ ထြက္ေပၚလာခဲ့တယ္...Vortigern ရဲ႕လူေတြအကုန္လံုး ဓားကို ေက်ာက္တံုးထဲက ဆြဲထုတ္ခဲ့ၾကေပမယ့္ တစ္ေယာက္မွ မေအာင္ ျမင္ခဲ့ဘူး..Vortigern ကို Black Magic ေပးတဲ့သူကေတာ့ ဒီဓားကိုဆြဲထုတ္ႏိုင္ တဲ့သူကို သတ္ၿပီးမွသာလ်င္ သူ႕လိုခ်င္ေနတဲ့ ေမွာ္စြမ္းအားေတြ ထပ္ရႏိုင္မွာ ျဖစ္လို႕ Vortigern ဟာဒီဓားကို ဆြဲထုတ္ဖို႕အတြက္ လူေတြေခၚၿပီးဆြဲထုတ္ ခိုင္းတယ္..Arthur ေရာက္လာခ်ိန္မွာေတာ့ ဓားကိုဆြဲထုတ္ ႏိုင္ခဲ့တယ္..အဲ့အခ်ိန္မွာပဲ Arthur အဖမ္းခံရၿပီး အသတ္ခံရဖို႕ ျဖစ္လာတဲ့ အခ်ိန္မွာ………..Arthur ပဲလြတ္ေျမာက္ သြားမလား..Vortigern ပဲ က်ရံႈးသြားမလား……..</p><p>~~~Review~~~</p><p>ဒီကားကို Trailer စျပတည္းက ၾကည့္ခ်င္ေနခဲ့တာ ခုၾကည့္လိုက္ရခ်ိန္မွာ လည္း စိတ္ေက်နပ္မူ ရရွိခဲ့တယ္...ဇာတ္ကားအစကို စစ္ပြဲေတြနဲ႕စထားေတာ့ အစမွာတည္းက အရွိန္တက္တယ္..King Uther ရဲ႕အခန္းကို လိုတာထက္ ပိုမျပခဲ့ဘူး..ဇာတ္လမ္းသြား ခပ္ျမန္ျမန္ေလးပဲ လုပ္ထားတယ္...Vortigern ရဲ႕အခန္းကဏၰ ကိုအစမွာတည္းက ခန္႔မွန္းလို႕ရေအာင္ ျပထားတယ္...တကယ္လည္း Arthur ရယ္ Vortigern ရဲ႕ဇာတ္ပဲေလ...Vortigern အခန္းတိုင္း ၾကည့္လို႕ေကာင္းတယ္..Jude Law သ႐ုပ္ေဆာင္တာလည္း အေတာ္ၾကည့္ေကာင္းတယ္..Vortigern နဲ႕လည္း လိုက္ဖက္တယ္လို႕ ထင္မိတယ္..Arthur ေနရာ သ႐ုပ္ေဆာင္တဲ့ Charlie Hunnam လည္း ဒီကားမွာ အေတာ္ျပင္ဆင္ထားတယ္..Body ပိုင္း physical ပိုင္း အထူးေျပာစရာ မလိုဘူး..<br>Arthur ဆိုတဲ့ character ကို အေသခ်ာ ျပင္ဆင္ထားေတာ့ အထူးေျပာေနစရာ မလိုဘူး..က်န္တဲ့ သ႐ုပ္ေဆာင္ေတြလည္း သူ႕ဟာနဲ႕တူ အေကာင္းဆံုး ပံပိုးေပးထားတယ္...GoT ထဲက ဇာတ္ေကာင္ အခ်ိဳ႕လည္းပါေသးတယ္...အဲ့ထဲမွာ Petyr Baelish ေနရာသ႐ုပ္ေဆာင္တဲ့ Aidan Gillen ရဲ႕အခန္းကေတာ့ ပိုမ်ားတယ္...သာမန္ထက္ေတာ့ မပိုခဲ့ဘူး သူ႕သ႐ုပ္ေဆာင္ခ်က္ေတြကေတာ့..</p><p>ဒီကားက သ႐ုပ္ေဆာင္ပိုင္း ေျပာစရာမရွိေပမဲ့ ဇာတ္လမ္းပိုင္းကေတာ့ ဆြဲေဆာင္မူသိမရွိခဲ့ဘူး..အက္ရွင္ အခန္းေတြက Trailer မွာပါတဲ့ဟာေတြထဲကပဲ ျပန္ပါတယ္..တစ္ခ်ိဳ႕အခန္းေတြက ေတာ့႐ုပ္ရွင္ၾကည့္တဲ့ အခါမွ ေတြ႕လိုက္ရတဲ့အတြက္ အေတာ္မိုက္ပါတယ္...ေနာက္တစ္ခ်က္က စကားေျပာေနရင္း ထထေဖာက္တာေလးေတြ မ်ားတယ္..scene တစ္ခုမွာ တစ္ႀကိမ္ေလာက္ဆို ရီရေပမဲ့ အဲအတိုင္းပဲ ထပ္ေျပာတဲ့ အခါက်ေတာ့ အတင္းရီခိုင္းသလိုျဖစ္တယ္…ေနာက္ၿပီး ဒါ႐ိုက္တာ က Sherlock Holmes 1,2 ႐ိုက္ခဲ့တာဆိုေတာ့ ဒီကားမွာ အဲ့ပံုစံ တြ အရမ္းသံုးတယ္..စကားေျပာေနရင္း flashback ေလးေတြနဲ႔ျပတာ ခဏခဏပဲ...serious ဖက္ သိပ္မသြားပဲနဲ႕ fun ေလးေတြ ၫွပ္ျပသြားတာေလးကေတာ့ သူ႕အႀကိဳက္နဲ႕သူပါပဲ…</p><p>ဒီကားကို ႀကိဳက္မိတဲ့အခ်က္ေတြက ေတာ့ပိုမ်ားတယ္.ပထမဆံုး ခ်ီးက်ဴးရရင္ Guy Ritchie ရဲ႕ visual effects ကေတာ္ေတာ္ အားရဖို႕ေကာင္းခဲ့တယ္..အက္ရွင္ အခန္းတိုင္းကို ႐ိုက္ထားတာ အရမ္းအားရဖို႕ေကာင္းတယ္..Sherlock Holmes မွာ ျမင္ခဲ့ရတဲ့ အက္ရွင္အခန္းပံုစံ ေတြကို ဒီကားမွာ အေကာင္းဆံုး ခ်ျပသြားႏိုင္ခဲ့တယ္...trailer မွာပါတဲ့ ဆင္အခန္းေတြဆို ရံုမွာ 3D နဲ႕ၾကည့္ရင္ အေတာ္ၾကည့္လို႕ေကာင္းတယ္..ဒီေနရာမွာ တစ္ခုေလာက္ေျပာခ်င္တာက ဒီကားကို ရံုေကာင္းေကာင္းမွာ 3D နဲ႕ၾကည့္ျဖစ္ေအာင္ ၾကည့္ၾကပါလို႕ေျပာခ်င္တယ္..တစ္ကားလံုး 3D effect ကို အေကာင္းဆံုး ႐ိုက္ျပသြားႏိုင္တယ္...ေနာက္ႀကိဳက္မိတဲ့ အခန္းကေတာ့ Sam Lee ရဲ႕ နာမည္ႀကီး သီခ်င္း The Wild Wild Berry ကို ႐ုပ္ရွင္ထဲမွာ ျပန္အသံုးျပဳသြားတာပဲ…ဒီကားကို ႀကိဳက္မိတဲ့အခ်က္ေတြက မ်ားတာေတာ့ အမွန္ပါပဲ…ေနာက္ဆံုး အခန္းဆိုရင္လည္း ႐ိုက္ထားတာ အေတာ္ကို အားရဖို႕ေကာင္းခဲ့ၿပီး ပရိတ္သတ္ အႀကိဳက္႐ိုက္သြား ခဲ့ႏိုင္တယ္..ဒီကားကို Fantasy နဲ႕modern age ေပါင္းၿပီး ႐ိုက္ျပခဲ့ပါတယ္..အခ်ိဳ႕႐ိုက္ခ်က္ေတြဆိုရင္ Game play ပံုစံနဲ႕ အေတာ္ကို ဆင္တူေအာင္႐ိုက္ထားပါတယ္..The Witcher game ကို ျပန္အသက္သြင္းၿပီး ႐ုပ္ရွင္ အျဖစ္ ႐ိုက္ကူး ခဲ့မယ္ဆိုရင္ေတာ့ အခုလိုမ်ိဳး visual effect ေတြနဲ႕ျမင္ခ်င္ေန မိတာေတာ့အမွန္ပါပဲ..ဒါေပမဲ့ series အျဖစ္႐ိုက္ကူးမယ္လို႕သတင္းေတြ လည္းထြက္ေနပါေသးတယ္..</p><p>ဒီကားဟာ ႏိုင္ငံတကာမွာUS နဲ႕ China တို႔မွာ ျပသခဲ့ၿပီး ျဖစ္ပါတယ္..UK မွာ ဒီအပတ္ ရံုစဝင္ၿပီး ျပသေတာ့ မွာလည္းျဖစ္တယ္..ဒါေပမဲ့ ကံဆိုးစြာနဲ႕ Rating ေတြဟာ မေကာင္းခဲ့တဲ့အတြက္ Box Office မွာ epic flop အျဖစ္မွတ္တမ္း ဝင္ဖို႕ရွိေနပါတယ္..ဒါဟာလည္း ဒီကားကို sword battle ေတြနဲ႕Fantasy မဆန္ခ်င္တဲ့ အတြက္ေၾကာင့္ပဲ ေပးခဲ့တာေတြ ျဖစ္လိမ့္မယ္ ထင္တယ္..Budget အရ 175 million အသံုးျပဳထားၿပီး ခုလက္ရွိ 58.1 mill ေလာက္ပဲရရွိထားပါေသးတယ္..2017 ခုႏွစ္ရဲ႕ Budget အမ်ားျပား သံုးၿပီး Box office flop ျဖစ္ဖို႕ရာခိုင္ ႏူန္းမ်ားေနပါတယ္..</p><p>အဆံုးသတ္ ေျပာရမယ္ဆိုရင္ 3D နဲ႕ရံုေကာင္းေကာင္းမွာ ၾကည့္ သင့္တဲ့ ကားေကာင္းတစ္ကားပါ..visual effects ႀကိဳက္ ႏွစ္သက္သူဆိုရင္ ေတာ့ ေျပာစရာ မလိုေတာ့ပါဘူး..ဝယ္လိုက္ရတဲ့ လက္မွတ္ဖိုးနဲ႕တန္တဲ့ကား တစ္ကားျဖစ္ပါတယ္..</p>', '2963,3149,2965,973,2966,2967,2968,2969,2970,3150,2972,2973,2974,2975,2976,2977,2978,2979,2980,2981,2982,2983,2984,2985,2986,2987,2988,2989,2990,2991,2992,2993,2994,2995,2996,2997,2998,2999,3000,3001,3002,3003,3004,3005,3006,3007,3008,3151,3010,3011,3', '3019', '3020,3023,3019,3020,3032', '0', '2017-05-12', '68', '1,10,12', NULL, '126 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.5', 0, 1, 15, 15, 15, 16),
(62, '', 'Knock Knock', NULL, 'knock-knock', '<p>Knock Knock (2015)<br>==============</p><p>မိသားစုနဲ႔ခြဲေနရတဲ့ကေလး၂ေယာက္အေဖ အီဗန္က ေမ်ာက္ဆိုတဲ့ေခြးတေကာင္နဲ႔အတူ ေအးခ်မ္းစြာေနထိုင္ေနရင္း မိုးသည္းညတညမွာ သူ႔အိမ္ကိုမိန္းမလွေလး၂ေယာက္တံခါးလာေခါက္ၿပီး မိုးခိုဖို႔တြက္အကူအညီလာေတာင္းၾကတယ္ မေမွ်ာ္လင့္ဘဲ တံခါးေခါက္သံတခုေၾကာင့္ အီဗန္ရဲ႕ဘဝက ေၾကာင္နဲ႔ၾကြက္တို႕ရဲ႕ေသလုေျမာပါးကစားပြဲၾကားထဲ က်ေရာက္သြားရပံုကို ရိုက္ကူးျပသထားတဲ့ဇာတ္ကားေလးျဖစ္ပါတယ္ အီဗန္အျဖစ္မင္းသားေခ်ာ Keanu Reeves က ပါဝင္သ႐ုပ္ေဆာင္ထားလို႔ စိတ္ဝင္စားစရာေကာင္းမွာေတာ့ေသခ်ာပါတယ္</p><p>အညႊန္းကို Zon Myat Noe Swe မွ ေရးေပးတာ ျဖစ္ပါတယ္။</p>', '3152,62,3153,3154,3155,3156,3157,3158,3159', '3160', '3160,3187,3162,3173,3174', '0', '2015-10-15', '46,68', '10,18', NULL, '99 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '5', 0, 1, 10, 10, 10, 11);
