(63, 'tt0373074', 'Kung Fu Hustle', NULL, 'kung-fu-hustle', '<p>မင္​းကားႀကီးစတီဖင္​​ေခ်ာင္​ရဲ႕အလြန္​​ေကာင္​းမြန္​တဲ့ရုပ္​ရွင္​​ေလးကို မိတ္​ဆက္​ပါရ​ေစ။ ဒီဇာတ္​ကားဟာ ဟာသကားလည္​းျဖစ္​သလို အက္​ရွင္​ကားလည္​းျဖစ္​ပါတယ္​။</p><p>ဇာတ္​လမ္​း​ေလးက​ေတာ့ ၁၉၄၀ဝန္​းက်င္​ တရုတ္​ျပည္​တြင္​လူဆိုးလူမိုက္​ဂိုဏ္​းအႀကီးဆံုးမွာပုဆိနိဂိုဏ္​းျဖစ္​ပါတယ္​။ မင္​းသားစတီဖင္​​ေခ်ာင္​ဟာ အရမ္​းကိုပဲပုဆိန္​ဂိုဏ္​းကိုဝင္​ခ်င္​​ေန​ေပမဲ့ အဲ့ဂိုဏ္​းဝင္​ျဖစ္​ဖုိ႔အတြက္​လူသတ္​ဖူးရမွာျဖစ္​ပါတယ္​။ ဒါ​ေၾကာင္​့သူနဲ႔သူ႔သူငယ္​ခ်င္​းဟာ လူအရမ္​းရႈပ္​တဲ့ရပ္​ကြက္​တစ္​ခုကိုသြားၿပီးလူမိုက္​သြားလုပ္​တယ္​။ အဲဒါလည္​းမ​ေအာင္​ျမင္​​ေတာ့ မ​ေက်နပ္​ပဲ ပုဆိန္​ဂိုဏ္​းကို​ေခၚသြားတယ္​။ အရမ္​းၾကမ္​းတမ္​းတဲ့ပုဆိန္​ဂိုဏ္​းရဲ႕တိုက္​ခိုက္​မႈ​ေတြကို အဲ့ရပ္​ကြက္​မွာသာမန္​လူ​ေတြလို​ေ​န​ေနတဲ့ Kung Fu Master ​ေတြကခုခံတိုက္​ခိုက္​ခဲ့ပါတယ္​။ ဂိုဏ္​း​ေခါင္​း​ေဆာင္​ကရႈံး​ေနတယ္​့အတြက္​​ေၾကာင္​့အလြန္​​ေၾကာက္​စရာ​ေကာင္​းတဲ့ Beast လို႔​ေခၚတဲ့ Kung Fu Master တစ္​​ေယာက္​ကို​ေခၚလာပါတယ္​။ အရမ္​းၾကမ္​းၾကဳတ္​ၿပီး သိုင္​းမွာလည္​း​ေတာ္​တယ္​့အတြက္​​ေၾကာင္​့ ရပ္​ကြက္​က သိုင္​းဆရာ​ေတြလည္​းမခုခံနိုင္​​ေတာ့ပါ။ အဲ့ခ်ိန္​မွာ မင္​းသားဟာ သူသာလ်ွင္​ Beast ကိုနိုင္​မယ္​့သူရဲ​ေကာင္​းဆိုတာကို​​​သိလာခဲ့တယ္​။</p><p>အရမ္​းကိုရယ္​ရတဲ့ကားျဖစ္​ၿပီး သိုင္​းအကြက္​​ေတြကလည္​းအရမ္​းကိုၾကည္​့​ေကာင္​းပါတယ္​။ ဒီဇာတ္​ကားဟာ ၂၀၀၄ခုနစ္​မွာထြက္​ခဲ့ၿပီး ၾကည္​့တိုင္​းမရိုးရတဲ့ကား​ေလးပါ။ ပရိတ္​သတ္​​ေတြလည္​းႀကိဳက္​မယ္​လို႔​ေမ်ွာ္​လင္​့ပါတယ္​။</p>', '3188,3189,3190,3220,3192,3221,3222,3195,3223,3224,3225,3226,3227,3201,3228,3203,3204', '3188', '3188,3229,3218,3219', '0', '2005-05-22', '4,18', '1,7,8,12', NULL, '99 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '7.3', 0, 1, 26, 26, 26, 27),
(64, 'tt4217392', 'Kung Fu Yoga', NULL, 'kung-fu-yoga', '<p>ဒီတစ္ခါေတာ့ ပရိသတ္ေတြ ၾကည့္ဖို႔ ၫႊန္းေပးခ်င္တဲ့ ဇာတ္ ကားေလးက Kung Fu Yoga ပါ။ ဒီဇာတ္ကားရဲ႕ ထူးျခားခ်က္ ကေတာ့ တ႐ုတ္နဲ႔ အိႏၵိယပူးေပါင္းတင္ဆက္ထားတာျဖစ္ၿပီး ပရိ သတ္အခ်စ္ေတာ္ သ႐ုပ္ေဆာင္ ဂ်က္ကီခ်န္း ေခါင္းေဆာင္ပါဝင္ ထားတာမို႔ စြန္႔စားခန္းေရာ၊ ဟာသေရာ၊ အက္ရွင္ေရာ မ်ိဳးစံုေအာင္ ခံစားၾကည့္႐ႈရမွာ ျဖစ္ပါ တယ္။</p><p>ဂ်က္ဟာ ကမၻာသိ ေရွး ေဟာင္း သုေတသန ပညာရွင္ ပါေမာကၡတစ္ေယာက္ပါ။ တစ္ ရက္မွာေတာ့ သူ႔ကို အိႏၵိယႏြယ္ ဖြား လူငယ္ပါေမာကၡ အက္ရွ္မီ တာက လာရွာခဲ့ၿပီး အိႏၵိယႏုိင္ငံရဲ႕ ေအဒီ ၆၄၇ ေလာက္တုန္းက အဖိုးတန္ေရွးေဟာင္းပစၥည္းတစ္ ခုကို ျပန္လည္ရွာေဖြေဖာ္ထုတ္ဖို႔ ျဖစ္လာပါတယ္။</p><p>အက္ရွ္မီတာဆီမွာ ေျမပံုရွိ ေပမယ့္ အေတြ႕အႀကံဳမ်ားတဲ့ ပါေမာကၡဂ်က္ကူမွသာ ရွာေတြ႕ ႏုိင္မွာမို႔ ပူးေပါင္းလုပ္ေဆာင္ဖုိ႔ ျဖစ္လာခဲ့ပါတယ္။ ပါေမာကၡဂ်က္ နဲ႔အတူ အက္ရွ္မီတာရယ္၊ သူ႔ လက္ေထာက္ကိုင္ရာ၊ ကြယ္လြန္ သြားတ့ဲ ဂ်က္မိတ္ေဆြရဲ႕သား ဂ်ံဳးစ္ရယ္။ ဂ်က္ရဲ႕ တပည့္ႏွစ္ ေယာက္ျဖစ္တဲ့ ေရွာင္ကြမ္းနဲ႔ ညိဳ မင္းတုိ႔ဟာ တိဗက္မွာရွိတဲ့ ကန္ လန္ေတာင္တန္းေတြကို ခရီးထြက္ခဲ့ၾကပါတယ္။</p><p>သူတို႔ရဲ႕ ေရွးေဟာင္းပစၥည္း ရွာပံုေတာ္ခရီးစဥ္ကို သိတဲ့အဖြဲ႕ ေတြရဲ႕ လိုက္လံေႏွာင့္ယွက္လုပ္ ႀကံျခင္းကို ခံခဲ့ရေပမယ့္ ဂ်က္ရဲ႕ သမုိင္းေၾကာင္း ေနာေက်မႈ၊ ကြန္ဖူးကြၽမ္းက်င္မႈေတြေၾကာင့္ ေၾကးစားလူသတ္သမားေတြလက္ကလြတ္ေျမာက္ခဲ့ပါတယ္။</p><p>ဂ်က္တို႔အဖြဲ႕ဟာ ထိန္းသိမ္း ေစာင့္ေရွာက္ဖို႔ လိုအပ္ေနတဲ့ ေရွး ေဟာင္းအေမြအႏွစ္ေတြကို ရွာ ေဖြမႈဆက္လက္လုပ္ေဆာင္ခဲ့ၿပီး ေတာ္လွန္ေရးအဖြဲ႕ေခါင္းေဆာင္ တစ္ေယာက္ျဖစ္တဲ့ ရန္ေဒါတို႔အ ဖြဲ႕ရဲ႕ ေႏွာင့္ယွက္တိုက္ခိုက္ျခင္းခံ ခဲ့ရပါတယ္။</p><p>ပါေမာကၡဂ်က္တုိ႔အဖြဲဲ႕ဟာ အမွန္အကန္စြန္႔စားခန္းေတြနဲ႔အ တူ တိဗက္ေရခဲလိုဏ္ဂူေတြကေန ဒူဘိုင္း၊ ေနာက္အိႏၵိယႏုိင္ငံက ေတာင္ေပၚဘုရားေက်ာင္းအထိ ခရီးဆန္႔ၿပီး ေရွးေဟာင္းအေမြအ ႏွစ္ေတြကို ဘယ္လိုရွာေဖြၾကမွာ လဲ။ လမ္းခရီးမွာေကာ ဘယ္လို ျပႆနာေတြ၊ အခက္အခဲေတြႀကံဳ ရမွာလဲဆုိတာ ကိုယ္တုိင္ၾကည့္႐ႈ ရင္း ဆက္လက္ခံစားလုိက္ၾကပါ ဦး။ ဂ်က္ကီခ်န္းဇာတ္ကားေတြ ရဲ႕ ထံုးစံအတုိင္း ဟာသ၊ အက္ ရွင္ဇာတ္ကြက္ေတြနဲ႔အတူ အိႏၵိယ အကအလွေတြ၊ ကေမာက္ကမရယ္စရာဇာတ္ကြက္ေတြနဲ႔မို႔ ပရိ သတ္ေတြ သေဘာက်မွာ ေသခ်ာ ပါတယ္။</p><p>ဒီဇာတ္ကားမွာ ဂ်က္အျဖစ္ ဂ်က္ကီခ်န္း၊ ဂ်ံဳးစ္အျဖစ္ အရစ္ဖ္ ရာမန္း၊ ေရွာင္ကြမ္းအျဖစ္ က်န္ရီ ရွင္း၊ ညိဳမင္းအျဖစ္ မီရာမူခ်ိ၊ ရန္ ေဒါအျဖစ္ ဆုိႏိုဆုဒ္၊ ကိုင္ရာအ ျဖစ္ ဒီရွာပက္တာနီတုိ႔ ပါဝင္သ႐ုပ္ေဆာင္ထားၾကပါတယ္။</p><p>အညႊန္းကိုေတာ့ 7daydaily မွကူးယူေဖာ္ျပထားျခင္းျဖစ္ပါတယ္။</p>', '3622,3623,3624,3625,3626,3627,3628,3629,3630,3631,3632,3633,3634,3635,3636,3637,3638,3639,3640,3641,3642,3643,3644', '3645', '3645', '0', '2017-01-27', '4', '1,4,7,17', NULL, '130 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '5.5', 0, 1, 20, 20, 20, 21),
(65, 'tt4951982', 'Kursk', NULL, 'kursk', '<p>kursk ဆိုတာ ႏ်ဴကလီးယား စြမ္းအင္သံုး ရုရွား ေရငုပ္သေဘာၤတစ္စီးရဲ႕ မေတာ္တဆ ျဖစ္ပြားမႈ ျဖစ္ရပ္မွန္သမိုင္းေၾကာင္းေလးကို ျပန္လည္ အသက္သြင္း<br>ရုိက္ကူးထားတာျဖစ္ပါတယ္ေနာ္။ ၂၀၀၀ ျပည့္ႏွစ္ ၾသဂုတ္လ ၁၂ မွာ စစ္ေရးေလ့က်င့္ဖို႕ ျပင္ဆင္ေနတုန္း ကာ့စ္သေဘာၤ ေပါက္ကြဲခဲ့တာပါ။<br>ေပါက္ကြဲမႈ ျဖစ္စဥ္အတြင္း ကံေကာင္းစြာနဲ႕ ေရငုပ္သေဘာၤပဲ့ပိုင္းမွာ အသက္ရွင္က်န္ရစ္ၾကတဲ့သူေတြဟာ ကယ္ဆယ္ေရးကို ေစာင့္ေမ်ွာ္ရင္း<br>ဘယ္လို ခက္ခက္ခဲခဲ ရုန္းကန္ခဲ့ၾကသလဲ၊သူတို႕ အသက္ရွင္သန္ႏိုင္ခဲ့လား မိသားစုေတြရဲ႕ စိုးရိမ္ပူပန္မႈကို ရုရွားေရတပ္ဘက္ကေရာ<br>ဘယ္လိုမ်ိဳး ေျဖရွင္းဖို႕ ႀကိဳးစားၾကသလဲ ၊ စတဲ့ အေၾကာင္းအရာေတြကို စိတ္၀င္စားဖြယ္ ၾကည့္ရမွာပဲ ျဖစ္ပါတယ္ေနာ္…ျဖစ္ရပ္မွန္သမိုင္းျဖစ္သလို<br>ဇာတ္ကားျပီးဆံုးခ်ိန္မွာ ရင္ထဲမွာ တစ္ခုခု စြဲက်န္ေစမယ့္ ဇာတ္ကားေလးတစ္ခုလို႕………</p><p>Review Credit to GC</p>', '3669,3738,3671,3672,3673,3674,3675,3676,3677,3678,3679,3739,3681,3682,3683,3684,3685,3686,3687,3688,3689,3690,3691,3692,3740,3694,3695,3741,3697,3742,3699,3700,3701,3743,3703,3704,3705,3706,3707,3708,3709,3710,3230', '3712', '3713,3715', '0', '2018-11-07', '53', '1,10,13,18', NULL, '118 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.7', 0, 1, 36, 36, 36, 37),
(66, 'tt1542344', '127 Hours', NULL, '127-hours', '<p>ဒီရုပ္ရွင္ကားဟာ Survival ကားႀကိဳက္တတ္သူေတြအတြက္ေတာ့ တကယ့္ကိုလက္မလႊတ္သင့္တဲ့ ရုပ္ရွင္ပါ ဒါေပမဲ့ ပံုမာန္ စိတ္လႈပ္ရွားစရာ survivalကားဆိုတာထက္ေတာ့ အမ်ားႀကီးပိုပါတယ္ ဒီရုပ္ရွင္ဟာက်ေနာ္တို႔ကိုေတြးစရာေတြတသီတတန္း ႀကီးေပးသြားပါလိမ့္မယ္</p><p>လူဆိုတာ ဆံုးရွံုးရမွ ေအာက္ေမ့ တတ္တဲ့အမ်ိဳးတဲ့.... ဟုတ္ပါတယ္<br>လူအေတာ္မ်ားမ်ားဟာ ကိုယ့္ရဲ႕ျဖစ္တည္မႈကို တန္ဖိုးမထားတတ္ၾကဘူး<br>သူတို႔ကိုယ္သူတို႔ အရမ္း ကံဆိုးတာပဲလို႔ ထင္ေနတတ္ၾကတယ္<br>တကယ္တမ္း ဆံုးရႈံးရၿပီဆိုေတာ့မွ ... သူတို႔ ဘယ္ေလာက္ကံေကာင္းခဲ့<br>တယ္ဆိုတာ သိၿပီး ေနာင္တေတြရတတ္ၾကတယ္ေလ<br>Aron အခုေတာ့ ေကာင္းေကာင္းႀကီး သေဘာေပါက္သြားပါၿပီ</p><p>Aron Ralston .... စြန္႔စား ရတာမွန္သမၽွ အကုန္ႀကိဳက္တဲ့သူ<br>ခရီးခဏခဏ ထြက္ေလ့ရွိၿပီး ဘဝကို ေပ်ာ္ေပ်ာ္ ျဖတ္သန္းတဲ့သူ ေလ<br>ဒါေပမဲ့ မိသားစုနဲ႔ အဆင္မေျပဘူး...... သူအေမ့ကိုမုန္းတယ္ အေမက<br>အတၱႀကီးတဲ့သူလို႔သူျမင္တယ္ အေမ ကသူ႔လုပ္သမၽွကိုအကုန္လိုက္<br>ပိတ္ပင္ေနတဲ့ သူလို႔ထင္ေနတယ္ ဒါေပမဲ့......</p><p>\"ငါသာအေမ့ဖုန္းကို ကိုင္ခဲ့ရင္ ဒီလိုမ်ိဳး ျဖစ္ေနမွာမဟုတ္ဘူး\"တဲ့<br>ေတာင္ၾကားထဲမွာ လက္ညပ္ၿပီး ထြက္မရဘဲ ေသေတာ့မွာသိေနတဲ့<br>သူတစ္ေယာက္ရဲ႕အေတြးေပါ့ သူအားလံုးကို အထင္လြဲခဲ့တာေတြ<br>တျဖည္းျဖည္းနားလည္လာတယ္ \"ငါအားလံုးကိုျပန္လိုခ်င္တယ္\" တဲ့<br>မရေတာ့တာသိေနေပမဲ့ ေအာက့္ေမ့ေနတယ္ေလ.....</p><p>ဒီဇာတ္ကားဟာ လူမသိသူမသိ ေတာင္ၾကားထဲမွာ ၁၂၇နာရီလံုးလံုး ပ္ိတ္မိေနတဲ့ သူတစ္ေယာက္ရဲ႕ အေတြးေတြကို ရိုက္ျပထားတာျဖစ္ပါတယ္<br>ရုပ္ရွင္ၾကည့္ၿပီးတာနဲ႔ ကိုယ္ဘယ္ေလာက္ကံေကာင္းတယ္ ဆိုတာ သိလာပါလိမ့္မယ္ ၾကည့္ရင္းၾကည့္ရင္းနဲ႔ အဆံုးကိုေရာက္မွန္းမသိေရာက္သြားတဲ့ကားမ်ိဳးပါ<br>လက္မလႊတ္သင့္တဲ့ ရုပ္ရွင္တစ္ခုျဖစ္ပါတယ္</p><p>အညႊန္းနဲ႔ဘာသာျပန္သူကေတာ့ ကိုေအာင္ခန္႔ခိုင္ဘဲျဖစ္ပါတယ္။</p>', '3744,3745,3746,3833,3748,3749,3750,3751,3752,3753,3754,3834,3756,3757,3758,3759,3760,3761,3835,3763,3764,3765,3766,3767,3768,3769,3770,3771,3772', '3773', '3775,3773,3768', '0', '2010-11-05', '68,70', '4,10,18', NULL, '94 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '7', 0, 1, 2, 2, 2, 3),
(67, 'tt6146586', 'John Wick: Chapter 3 – Parabellum', NULL, 'john-wick-chapter-3-parabellum', '<p>The Continental Hotelမွာ လူမသတ္ရ စည္းမ်ဥ္းကို ေဖာက္ဖ်က္လိုက္တဲ႕ John Wickဟာ တစ္ကမၻာလံုးက ေၾကးစားလူသတ္သမားေတြ အတြက္ $14 million တန္ targetတစ္ခုျဖစ္လာျပီး အခု Chapter 3မွာ ေၾကးစားေတြလက္ကလြတ္ေအာင္ ျပန္တိုက္ခိုက္ ထြက္ေျပးရေတာ႕မွာ ျဖစ္ပါတယ္။</p><p>John Wickကို ယံုၾကည္ေနေသးတဲ႕ ေၾကစားလူသတ္သမား Sofia(Halle Berry)ရဲ႕ အကူအညီနဲ႕ အျခား ေၾကးစားလူသတ္သမားေတြကို ရင္ဆိုင္ၾကရတဲ႕အခါ..</p><p>Review Credit</p>', '3152,2883,1401,3836,3837,3866,3839,1768,1615,3840,3841,3867,3843,3844,3845,3846,3847,3244,3848,3849,3850,3851,3852,3853,485', '3259', '3260,3864,2586,3260,3260,3865', '0', '2019-05-15', '68', '1,8,18', NULL, '131 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '7.1', 0, 1, 26, 26, 26, 27),
(68, '', 'Apocalypse - La 2ème guerre mondiale', NULL, 'apocalypse-la-2me-guerre-mondiale', '<p>A six-part French documentary about the Second World War composed exclusively of actual footage of the war as filmed by war correspondents, soldiers, resistance fighters and private citizens. The series is shown in color, with the black and white footage being fully colorized, save for some original color footage. The only exception to the treatment are most Holocaust scenes, which are presented in the original black and white.</p>', '3868,3869,3870,3886,3872,3887,3874,3888,3876,3877,3878', '3882,3883', '3884,3882,3883,3889', '0', '2019-08-15', NULL, '9', NULL, '', 'HD', 1, 0, 0, NULL, NULL, NULL, '8.7', 1, 1, 3, 3, 3, 4),
(69, '', 'The Walking Dead', NULL, 'the-walking-dead', '<p>Sheriff\'s deputy Rick Grimes awakens from a coma to find a post-apocalyptic world dominated by flesh-eating zombies. He sets out to find his family and encounters many other survivors along the way.</p>', '462,419,2679,3890,3891,3892,3893,3894,3895,3896,3897,3898', '1', '3903,3904,3905', '0', '2019-08-15', '85', '10,40,41', NULL, '', 'HD', 1, 0, 0, NULL, NULL, NULL, '7.3', 1, 1, 5, 5, 5, 6),
(70, '', 'Mr. Robot', NULL, 'mr-robot', '<p>A contemporary and culturally resonant drama about a young programmer, Elliot, who suffers from a debilitating anti-social disorder and decides that he can only connect to people by hacking them. He wields his skills as a weapon to protect the people that he cares about. Elliot will find himself in the intersection between a cybersecurity firm he works for and the underworld organizations that are recruiting him to bring down corporate America.</p>', '3906,3907,3908,3909,3910,3916,3912,3913,3914', '1', '1', '0', '2019-08-15', '85', '8,10', NULL, '', 'HD', 1, 0, 0, NULL, NULL, NULL, '7.9', 1, 1, 6, 6, 6, 7),
(71, '', 'Chernobyl', NULL, 'chernobyl', '<p>A dramatization of the true story of one of the worst man-made catastrophes in history, the catastrophic nuclear accident at Chernobyl. A tale of the brave men and women who sacrificed to save Europe from unimaginable disaster.</p>', '3917,4185,3919,3920,3921,3922,3923,4186,3925,3926,3927,3928,3929,3930,3931,3932,3933,2991', '3936', '3935', '0', '2019-08-15', '85', '10', NULL, '', 'HD', 1, 0, 0, NULL, NULL, NULL, '8.5', 1, 1, 8, 8, 8, 9),
(72, '', 'The Secret Life of Pets 2', NULL, 'the-secret-life-of-pets-2', '<p>The Secret Life of Pets 2 (2019) သည္ IMDb 6.6/10 Rotten Tomatoes 57% Metacritic 55% Google users 90% ဒါရုိက္တာ Chris Renaud, Jonathan del Val တုိ႕က ရုိက္ကူးထား၍ Brian Lynch က ဇာတ္လမ္းဇာတ္ညႊန္းေရးသားကာ အသံသရုပ္ေဆာင္ Patton Oswalt, Kevin Hart, Harrison Ford တုိ႕ ပါဝင္သရုပ္ေဆာင္ထားေသာ Animation, Adventure, Comedy ဇာတ္ကားေကာင္း တစ္ကားျဖစ္တဲ့အတြက္ ခ်စ္ျခင္းအားျဖင့္ တင္ဆက္လုိက္ပါရေစ…</p><p>မက္စ္ နဲ႕ သူ႕ရဲ့ အခ်စ္ေတာ္ မိတ္ေဆြမ်ားရဲ့ ဇာတ္လမ္းအဆက္ပါ သူတုိ႕ရဲ့ ပုိင္ရွင္ေတြက အလုပ္ သုိ႕မဟုတ္ ေက်ာင္းကုိ ေန႕တုိင္း ထြက္သြားျပီးတဲ့ေနာက္ သူတုိ႕ရဲ့ လွ်ိဳ႕ဝွက္ဘဝေတြ အေၾကာင္း ဆက္လက္ရုိက္ကူးျပထားတာကုိ ဘယ္လုိ စြန္႕စားခန္းဟာသေတြ ေတြ႕ရမလဲ ဇာတ္ကားမွာ ဆက္လက္ၾကည့္ရႈခံစားေပးၾကပါခင္ဗ်ာ…</p><p>Credit Review</p><p>Translated By Arrow</p>', '4187,4188,1641,4189,4190,4191,2548,1676,4192,4193,4194,4195,4196,4197,4198,4199,4200,4201,4202,1700', '4203', '4204,4204', '0', '2019-05-24', '68', '4,5,7,11', NULL, '86 Min', 'HD', 1, 0, 0, NULL, NULL, NULL, '6.5', 0, 1, 20, 20, 20, 21);
